INSERT INTO `fatloss_msg_desc` (`id`, `fmid`, `message`, `dayflag`, `priority`, `ispositive`) VALUES
(1, 2, 'It seems like you are not eating often enough during the day for your body to stay in constant Fat Burning Mode. Tomorrow, try to eat a meal or snack every 2-3 hours. Check the "Snack & Treat Guide" for easy and portable snack ideas so you''re never without a Fat Loss meal or snack!\r\n', 0, 1, 0),
(2, 2, 'Well, here''s the thing: You''re not eating frequently enough during the day. It''s very important to eat a meal or snack every 2-3 hours, to keep your body in that awesome Fat Burning Mode! Set a timer on your watch or computer as a reminder if you''re having issues!\r\n', 0, 1, 0),
(3, 2, 'When your body doesn''t get enough food, it goes into Fat Storing Mode - boo! To stay out of that dreaded place, make sure you''re eating every 2-3 hours every day. You might have messed up today, but you can do it tomorrow!\r\n', 0, 1, 0),
(4, 2, 'This week you had a bit of trouble with your meal timing, and did not eat often enough throughout the day. Eating frequent meals and snacks not only keeps you in Fat Burning Mode, it also improves concentration, energy levels and blood sugar regulation! Next week make a plan and stick to it!\r\n', 1, 1, 0),
(5, 2, 'Meal timing is often the hardest thing to learn in a new plan, but eating every 2-3 hours is key to the Food Lovers system. You were off a bit this week and didn''t eat often enough, but next week, write your meal times in your planner or journal. Do your very best to stick to it, and reward yourself at the end of the week if you stick to your guns!\r\n', 1, 1, 0),
(6, 2, 'Were you particularly busy this week? Because your meal timing was off. Sometimes we forget to eat on time when life gets in the way. But it''s very important to stick to your 2-3 hour window for optimal fat burning and weight loss. Look at your schedule and pack portable meals and snacks to take with you if you''re having a busy week again next week!\r\n', 1, 1, 0),
(7, 2, 'One of the biggest challenges with weight loss is often meal timing. This month you didn''t eat frequently enough, which may have put you into Fat Storing Mode! Your best offense is a good defense: At the beginning of each week, plan ahead when you''re going to eat each day and pack meals and snacks so you can accomplish that goal. You can do it! It just takes a little foresight.\r\n', 2, 1, 0),
(8, 2, 'Eating every 2-3 hours is key to the Food Lovers system. When you don''t stick to that plan, like you did this month, you risk going into Fat Storing Mode, exactly where you don''t want to be! Next month, be diligent about your meal timing. Set an alarm on your watch or computer to remind you when to eat and review the Snack and Treat Guide for easy ideas for food on the go.\r\n', 2, 1, 0),
(9, 2, 'This month you didn''t eat frequently enough. When you eat every 2-3 hours your body has plenty of food and nutrients to sustain itself until your next meal or snack. If you wait longer than that, you risk getting too hungry and overeating when you do finally get to sit down to eat again! Stick to your plan and your goals by making it a point to eat on a schedule next month.\r\n', 2, 1, 0),
(10, 3, 'For optimal Fat Burning, you should eat a meal or snack every 2-3 hours. You seem to be eating more often than that, which might put you into Fat Storing Mode instead. Yikes! Reassess your eating schedule and see where you can make improvements.\r\n', 0, 1, 0),
(11, 3, 'It appears that you''re eating more often than the recommended 2-3 hour window. This could be putting you into Fat Storing Mode, so be more aware of your meal timing to stick to your plan!\r\n', 0, 1, 0),
(12, 3, 'Are you eating more frequently than is recommended? Try to stick to the 2-3 hour window, which is ideal for fat burning and blood sugar stabilization.\r\n', 0, 1, 0),
(13, 3, 'This week you''ve been eating more often than every 2-3 hours. Eating as frequently ss you are might interfere with digestion and nutrient absorption, so try your best next week to stick to the plan.', 1, 1, 0),
(14, 3, 'You''ve been eating more frequently than the recommended 2-3 hour window. For next week, plan out your meals in advance and write them into your planner. Try your hardest to stick to that plan, and make all your meals and snacks to ensure they are filling and satisfying.\r\n\r\n', 1, 1, 0),
(15, 3, 'You''ve got the right idea - eating more frequently - but this week you''ve been eating too often. Try to stick to the 2-3 hour window between meals and snacks to keep your body in Fat Burning Mode!\r\n', 1, 1, 0),
(16, 3, 'This month it seems you''ve been eating more frequently than the recommended 2-3 hour time window. Is it because you''re always hungry? Make sure you''re drinking enough water as thirst can be construed as hunger. Also make sure your meals contain the right portions of all food groups - Protein, Fat, Fast Carbs and Slow Carbs. Review your Food Journal to see where you can make improvements.\r\n', 2, 1, 0),
(17, 3, 'Eating frequently is key to the Food Lovers plan, but this month you ate too frequently. Having a meal or snack every 2-3 hours is the ideal timing for digestion, nutrient absorption and blood sugar regulation. Review your food journal and see where you can make improvements next month with your meal timing.\r\n', 2, 1, 0),
(18, 3, 'Are you still hungry after eating a meal or snack? It seems that way, since this month you ate more frequently than the recommended 2-3 hour time window. Investigate your portion sizes - are they correct? Have you been eating all your meals in balance? Does each meal contain a Fat? Do a little research and see where you can tweak things a little so that your meals and snacks keep you satisfied for a full 2-3 hours.\r\n', 2, 1, 0),
(19, 4, 'Hello! You waited more than 30 minutes after waking to eat your first meal or snack! It''s very important to "break your fast" early, to get your body''s metabolism back into Fat Burning Mode, so eat something!  See the "I Love To Eat Cookbook" for some easy and fast breakfast ideas.\r\n', 0, 1, 0),
(20, 4, 'Today you didn''t break your fast! Waiting more than 30 minutes after waking to eat a meal or snack can put you into Fat Storing Mode. So chow down when you rise to get your body''s internal fire revving in high gear straightaway.\r\n', 0, 1, 0),
(21, 4, 'Remember to eat within 30 minutes of rising! You forgot today. This gives your body fuel to work with right away and stokes your fat burning fire the rest of the day.\r\n', 0, 1, 0),
(22, 4, 'So you''re not a morning person, hey? Even so, you need to eat something - a meal or a snack - within 30 minutes of rising. This week you didn''t quite get there, but next week try your best to remedy that situation.\r\n', 1, 1, 0),
(23, 4, 'This week you didn''t eat within 30 minutes of getting up. Sometimes it''s hard to eat first thing, but even something small like a piece of fruit, a yogurt, or a smoothie can do wonders for your metabolism. Try having something small next week and see how you feel!\r\n', 1, 1, 0),
(24, 4, 'Eating within a half hour of rising gets your metabolism going right off the bat! You weren''t so successful with that idea this week, but next week do your best. At least try it - all you have to lose is some more fat!\r\n', 1, 1, 0),
(25, 4, 'Some people have a hard time eating in the morning, and you seem to be one of them! This month you didn''t eat within 30 minutes of rising very often. So next month, even if you''re not a ''breakfast'' person, have something small to literally ''break your fast'' and move your body from sleep mode into Fat Burning Mode right away. The rest of the day you''ll be burning fat like a champ! \r\n', 2, 1, 0),
(26, 4, 'This month you didn''t eat within 30 minutes of rising very often. Try to be more diligent in the coming month about eating a breakfast of some kind - be it a small snack or an actual meal - to kick your body into high gear and get your metabolism going right away in the morning. \r\n', 2, 1, 0),
(27, 4, 'Because you''ve been sleeping for 7-8 hours during the night (we hope!) your body is hungry! This month you didn''t feed it quickly enough, giving it sustinance within 30 minutes of rising like you should have. Next month, make sure that happens, even if it means getting up 10-15 minutes earlier to make a smoothie or some eggs. It''s thatimportant!\r\n', 2, 1, 0),
(28, 5, 'Last night it seems you had 5 or less hours of sleep. But Hello - Lack of sleep can dramatically affect your weight loss goals! Review Day 7 in the "21 Day Metabolism Makeover" for more information, and tips on how to get 7-8 hours of sleep each night.\r\n', 0, 1, 0),
(29, 5, 'Lack of sleep is a big contributor to weight gain, believe it or not, and you''re not getting the recommended 7-8 hours! Tonight, make sure you get plenty of Zzzs to stay in Fat Burning Mode!\r\n', 0, 1, 0),
(30, 5, 'You''re shorting yourself on sleep - last night you got 5 hours or less! Lack of sleep can have a negative affect on your metabolism and therefore your weight loss goals.  Refer back to Day 7 in the "21 Day Metabolism Makeover" for more info!\r\n', 0, 1, 0),
(31, 5, 'This week you got 5 hours or less of sleep on several nights! Remember that sleep is important to help rejuvenate your body and accelerate your fat loss, so next week make it a point to get more sleep. Turn off the TV, shut down your computer and relax a little - all you have to lose is more fat!\r\n', 1, 1, 0),
(32, 5, 'Sleep is extremely important in the weight loss picture and last week you didn''t get nearly enough. Next week, adjust your schedule and obligations so you can get at least one if not two more hours of sleep per night so you can be a fat burning machine on waking!\r\n', 1, 1, 0),
(33, 5, 'You''ve been shortchanging yourself in the bedroom this week!   For optimal weight loss, digestion, recovery and metabolic function you should be getting between 7-8 hours every night. Make that a priority next week!  \r\n', 1, 1, 0),
(34, 5, 'On a number of days this month you''ve been logging 5 hours of less of sleep per night! Are you exhausted? Your body needs 7-8 full hours to repair itself and prepare for the next day. Any less than that and you''re running on fumes (and probably a lot of coffee!) Make it your goal this month to sleep more and stress less and you''ll burn more fat!\r\n', 2, 1, 0),
(35, 5, 'You have not been getting enough sleep this month, period! Lack of sleep increases cravings, elevates cortisol and inhibits muscle building - all of which lead to fat storage! To stay in Fat Burning Mode, get between 7-8 hours of sleep every night. Start tonight and make in a goal for this month to stick to that plan!\r\n', 2, 1, 0),
(36, 5, 'This month you simply didn''t get enough sleep. Many studies show a strong link between sleep deprivation and obesity! Getting 7-8 hours of sleep per night could be the difference between reaching your weight loss goals or falling short. Make it your goal this month to get more Zzzs and see how it affects your results! \r\n', 2, 1, 0),
(37, 6, 'It seems as if you did not exercise at all this week. Remember that exercise is a great way to boost metabolism, which can accelerate your weight loss and get you to your goals faster! Refer back to the "21-Day Metabolism Makeover" and review the benefits of exercise!\r\n', 1, 1, 0),
(38, 6, 'Did you get in your exercise this week? It does not seem like it! Exercise is great for your body, mind and spirit and can accelerate your results when done regularly. Make it a point next week to get in your exercise for sure!\r\n', 1, 1, 0),
(39, 6, 'This week you did not get enough exercise. Remember that cardio and resistance training can help you lose fat and add fat-burning muscle, which together can maximize your results. Make a plan to start your exercise regimen next week!\r\n', 1, 1, 0),
(40, 6, 'This month you did not get in enough exercise. If you want faster results and a healthier body and mind, make it a point to do so next month. You''l feel better both physically and mentally, and it will boost your metabolism, moving you closer to your goals!\r\n', 2, 1, 0),
(41, 6, 'You didn''t exercise this month! Remember that exercise is a great way to burn calories and fat, and that cardio and resistance training can greatly accelerate your weight loss. Look at your schedule for next month and pencil in time to exercise. You''ll be thankful that you did!\r\n', 2, 1, 0),
(42, 6, 'If someone told you that in just 20 minutes at day, 3-4 times a week, you could accelerate your fat-burning and lose tons of weight, would you do it? Well it''s true! Exercise is a simple way to maximize your results and it only takes a small amount of time out of your day. Make it a goal next month to exercise regularly!\r\n', 2, 1, 0),
(43, 7, 'It seems like your snacks today were a little too small! Make sure each snack you have is 100-200 calories for guys, and 75-150 calories for women. Don''t know what to eat? Check out the "Snack and Treat Guide" for ideas!\r\n', 0, 2, 0),
(44, 7, 'Today your snacks were too small. A snack needs to contain enough calories that it tides you over until your next meal. Look up snacks in the "Snack and Treat Guide" if you''re unsure of the calorie content of certain things.\r\n', 0, 2, 0),
(45, 7, 'Your snacks today were too small. Think of a snack as a half a meal: a half a turkey sandwich on whole wheat, a meatball and some spaghetti, or a small slice of pizza. It should run 100-200 calories for men and about 75-150 for women.  \r\n', 0, 2, 0),
(46, 7, 'This week your snack size was too small. Snacks are like mini-meals, designed to tide you over until it''s time to eat a whole meal again, so don''t cut them too small. Otherwise, by the time you do have a meal you''ll be famished and at risk of overeating! Review the "Snack and Treat Guide" for proper snack portions.\r\n', 1, 2, 0),
(47, 7, 'With Food Lovers, snacking is encouraged! We want you to be eating frequently throughout the day to keep your metabolism elevated and your Fat Burning Mode in high gear. This week you didnâ€™t eat large enough snacks, so your metabolism slowed, putting you at risk of storing fat. Make it a goal next week to change that - eat good, solid snacks to help you stick to your goals!\r\n', 1, 2, 0),
(48, 7, 'The snacks you ate this week were not big enough. Try your best next week to hit more on the mark: 100-200 calories per snack for men and 75-150 calories per snack for women. Compare the snacks you ate to those in the "Snack and Treat Guide" for reference.\r\n', 1, 2, 0),
(49, 7, 'Snacking is an important component of the Food Lovers system and this month your snacks weren''t up to snuff. Many times they didn''t contain enough calories to do their job properly: sustaining you between meals and keeping your energy high all day long. Do a review of snacking and look back at the "Snack and Treat Guide." Choose some better options to try out next month to keep your weight loss goasl on track!\r\n', 2, 2, 0),
(50, 7, 'The snacks you ate this month were not large enough. Make it a goal next month to be diligent about proper snack portions. Pack yourself plenty of snacks so you have one handy in the car or on the go, so you don''t miss one or skimp on portion size.\r\n', 2, 2, 0),
(51, 7, 'When trying to lose weight, meal and snack size is of utmost importance. Most people overeat during snack time but this month you underate. Undercutting your snack calories can lead to binge eating later on, which can completely derail your fat burning system! Make sure next month your snacks contain 100-200 calories for men and 75-150 calories for women.\r\n', 2, 2, 0),
(52, 8, 'Today, one or more of your snacks was larger than it should have been. To stay within Fat Burning Mode keep your calories between 100-200 for men and 75-150 for women.\r\n', 0, 2, 0),
(53, 8, 'Your snacks today were a bit too big! Refer back to the "Snack & Treat Guide" for plenty of great snack ideas that will keep you in Fat Burning Mode.\r\n', 0, 2, 0),
(54, 8, 'Snacks are supposed to be like 1/2 of a meal; today yours were a bit too large.  Keep your snack size between 100-200 calories for men and 75-150 calories for women to stay in Fat Burning Mode tomorrow!\r\n', 0, 2, 0),
(55, 8, 'Your snacks this week have been on the large side; try next week to cut them back a bit. If you''ve been hungry, make sure your meals are satisfying enough so that you''re not looking for more food come snack time.\r\n', 1, 2, 0),
(56, 8, 'Your snacks this week were too large, and some were almost like meals. A snack is supposed to be a small tide-over until your next meal, leveling out blood sugar and staving off cravings. Check out some snack ideas in the "Snack and Treat Guide" if you''re confused about portions.\r\n', 1, 2, 0),
(57, 8, 'Be careful about your snack sizes - this week they were too large. Review your snack options in the "Snack and Treat Guide", then look at your Food Journal and compare. Make adjustments to get back on track next week!\r\n', 1, 2, 0),
(58, 8, 'This month your snacks were too large. Eating too much at snack time adds calories to your daily intake that you weren''t planning on, and could derail your fat burning plans. Look over your food journal entries: each snack should be 75-150 calories for women and 100-200 calories for men. Take some notes and next month make some tweaks to your plan to stay in Fat Burning Mode!\r\n', 2, 2, 0),
(59, 8, 'A snack is just that: a snack, something to tide you over until meal time. Last month many of your snacks were too large and were almost meals! When your snacks are too large, you''re getting too many calories and are inhibiting your weight loss. Rein it in a bit and trim your snacks back to achieve your goals.\r\n', 2, 2, 0),
(60, 8, 'Your snacks this month have been on the large side. If you''re thathungry come snack time, investigate your meals: are they satisfying enough? Did they contain all the food groups - Fat, Protein, Fast Carbs and Slow Carbs? Do a little sleuthing and math and see where you can make some adjustments. Next month keep your snacks in check and your meals fulfilling and wholesome.\r\n', 2, 2, 0),
(61, 9, 'How many glasses of water did you drink today? It wasn''t 7 was it? Remember that water is an integral part of your weight loss. Make sure you get at least 7 glasses tomorrow - if not more!\r\n', 0, 2, 0),
(62, 9, 'You didn''t drink enough water today! Water is important for digestion, hydration and satiety so make sure tomorrow you increase it to at least 7 glasses a day, if not more!\r\n', 0, 2, 0),
(63, 9, 'Staying hydrated is important for weight loss, and today you didn''t drink enough. Get back on the fat-loss track tomorrow by drinking 7 glasses or more!\r\n', 0, 2, 0),
(64, 9, 'This week you didn''t drink enough water. Remember: water can help you lose weight! It supresses appetite, prevents water retention and aids digestion, so next week make it a goal to take in at least 7 glasses a day! \r\n', 1, 2, 0),
(65, 9, 'Drinking water is vitally important to weight loss, and water enables most of our internal systems to work more efficiently. This week you didn''t drink nearly enough, so make sure you get a minimum of 7 glasses daily next week.\r\n', 1, 2, 0),
(66, 9, 'Your body needs water to metabolize foods and fat. This week you didn''t drink enough, and risked putting a damper on your metabolism. Bring your intake up to 7 glasses or more per day for optimal results!\r\n', 1, 2, 0),
(67, 9, 'This month you didn''t drink enough water. Sometimes it''s hard to remember to do so, especially if you''re busy, but there are ways to get in your water fairly painlessly. Invest in a plastic water bottle to carry with you everywhere, and set a reminder on your watch or phone to prompt you to drink up. Heck, drink two glasses with each meal and one glass with each snack and that takes care of 8-9 glasses right there!\r\n', 2, 2, 0),
(68, 9, 'Next month you need to drink more water, at leas 7 or more glasses per day. Water is essential for metabolism, good health, and proper digestion, as well as healthy skin, nails and hair. Make it your goal to get all that you need and more in the coming weeks and see how it affects your mood, energy and fat loss results!\r\n', 2, 2, 0),
(69, 9, 'You didn''t drink nearly enough water this month, possibly depriving yourself of some additional metabolic boosts and some fat loss. Next month increase your water intake daily, and write it in your journal. At the end of next month compare your results and then compare your energy levels and fat loss!\r\n', 2, 2, 0),
(70, 10, 'You''re still not getting enough sleep - you got 5-6 hours last night, but could use 1-2 more, for sure. Work on that tomorrow!\r\n', 0, 2, 0),
(71, 10, 'You noly got 5-6 hours of sleep last night which is not enough! Lack of sleep is a big contributor to weight gain, believe it or not, and you''re not getting the recommended 7-8 hours! Tonight, make sure you get plenty of Zzzs to stay in Fat Burning Mode!\r\n', 0, 2, 0),
(72, 10, 'You''re shorting yourself on sleep - last night you only got 5-6 hours! Lack of sleep can have a negative affect on your metabolism and therefore your weight loss goals.  Refer back to Day 7 in the "21 Day Metabolism Makeover" for more info!\r\n', 0, 2, 0),
(73, 10, 'This week you got 5-6 hours of sleep on several nights! Remember that sleep is important to help rejuvenate your body and accelerate your fat loss, so next week make it a point to get more sleep. Turn off the TV, shut down your computer and relax a little - all you have to lose is more fat!\r\n', 1, 2, 0),
(74, 10, 'Sleep is extremely important for successful weight loss, and last week you didn''t get nearly enough. Next week, adjust your schedule and obligations so you can get at least one if not two more hours of sleep per night so you can be a fat burning machine on waking!\r\n', 1, 2, 0),
(75, 10, 'You''ve been shortchanging yourself in the bedroom this week!  For optimal weight loss, digestion, recovery and metabolic function you should be getting between 7-8 hours every night. Make that a priority next week!  \r\n', 1, 2, 0),
(76, 10, 'More often than not this month you''ve been logging 5-6 hours of sleep per night! But your body needs 7-8 full hours to repair itself and prepare for the next day. Any less than that and you''re running on fumes (and probably a lot of coffee!) Make it your goal this month to sleep more and stress less and you''ll burn more fat!\r\n', 2, 2, 0),
(77, 10, 'You have not been getting enough sleep this month, period! Lack of sleep increases cravings, elevates cortisol and inhibits muscle building - all of which lead to fat storage! To stay in Fat Burning Mode, get between 7-8 hours of sleep every night. Start tonight and make in a goal for this month to stick to that plan!\r\n', 2, 2, 0),
(78, 10, 'This month you simply didn''t get enough sleep. Many studies show a strong link between sleep deprivation and obesity! Getting 7-8 hours of sleep per night could be the difference between reaching your weight loss goals or falling short. Make it your goal this month to get more Zzzs and see how it affects your results! \r\n', 2, 2, 0),
(79, 11, 'This week you didn''t do as much cardio as you could have.  Remember that cardio burns fat and calories and can help accelerate your weight loss results. Find the time next week to fit it in!\r\n', 1, 2, 0),
(80, 11, 'You didn''t do very much cardio this week! If you want to truly make the most of your program, find the time to do cardio next week. You''ll lose weight more quickly and will feel healthier and better than ever before.\r\n', 1, 2, 0),
(81, 11, 'You did a little cardio this week, but not enough! To really get your metabolism revving and your fat loss rolling, try to do more. Look at your schedule next week and see where you can fit it into your routine!\r\n', 1, 2, 0),
(82, 11, 'This month you did some cardio, but should ideally be doing more. Cardio works your heart, lungs, muscles and joints, while burning tons of fat and calories. Plan your next month so that you get in at least 2-3 days a week of cardio to accelerate your results! \r\n', 2, 2, 0),
(83, 11, 'You did ok this month on your cardio, but could be doing more. Remember that cardio boosts your metabolism and makes your body and mind healthier and happier all day long. Plus, it helps you burn calories and shed fat! Make it a goal next month to do more cardio and you''ll be at your goal weight in no time!\r\n', 2, 2, 0),
(84, 11, 'In order to lose weight and get in shape, you need to be doing more cardio. Cardio works to burn calories and fat while improving your heart and circulatory function. Everyone is busy, but you can find the time to do it if you''re diligent.  Try to find fun activities that you enjoy anyhow, like walking the dog, or taking a walk with your spouse or kids.  You''ll be happy you did!\r\n', 2, 2, 0),
(85, 12, 'This week you did a little resistance training but could be doing more. Resistance builds fat-burning muscle, which also boosts metabolism! Schedule in more days of resistance trainning next week to turn your body into a fat-burning machine!\r\n', 1, 2, 0),
(86, 12, 'You could be doing more resistance training than you are. Resistance training builds lean muscle - your body''s fat-burning furnace! - and makes your body and bones stronger and leaner. Find the time next week to add more resistance training to your routine!\r\n', 1, 2, 0),
(87, 12, 'Resistance training is one of the keys to accelerated weight loss and you should really try to do more of it. Look at your schedule next week and pencil in your workouts ahead of time. Treat them like you would any other appointment and stick to it!\r\n', 1, 2, 0),
(88, 12, 'This month you didn''t do enough resistance training. Building lean, fat-burning muscle is a good goal for everyone doing Food Lovers, and one of the best way to do that is with resistance training. Make it a point next month to do some resistance training regularly, burning more fat and calories and moving you toward your goals faster!\r\n', 2, 2, 0),
(89, 12, 'In order to maximize your results, you should try to do more resistance training. This is key for building lean muscle, boosting metabolism, and burning more fat all day long. Make it a goal next month to be diligent about doing resistance and your results will come that much quicker!\r\n', 2, 2, 0),
(90, 12, 'Your muscles are your ultimate fat-burning furnace, and you aren''t maximizing them! Resistance training is key when trying to transform your body, so next month try to be more diligent about doing some form of resistance regularly.\r\n', 2, 2, 0),
(91, 13, 'This week you did some cardio and resistance training, but try to do a little more. Sometimes it''s hard when life gets busy, but try to be more regular with your exercise plan for better results!\r\n', 1, 2, 0),
(92, 13, 'You did some cardio and resistance trianing this week, but ideally you should be doing more. Remember that exercise is the best way to boost metabolism and get results faster, so make the time for it next week!\r\n', 1, 2, 0),
(93, 13, 'You did a bit of cardio and resistance training this week but could be doing more. Schedule it into your planner like any other appointment and stick to it - you''ll be healthier, happier and thinner in no time!\r\n', 1, 2, 0),
(94, 13, 'This month you did some cardio and resistance training but could be doing more. Exercise works to increase your metabolic rate and doing it regularly can accelerate your results on Food Lovers.  Make it a point next month to do more cardio and resistance training for optimal health and fat loss!\r\n', 2, 2, 0),
(95, 13, 'You did some cardio and resistance training this month, but really could be doing more. Resistance training adds lean muscle to your frame, your fat burning furnace. Cardio helps burn calories and fat, and together they can maximize your results. Next month, make it a goal to get in more exericse on the whole and you''ll move more quickly toward your goals!\r\n', 2, 2, 0),
(96, 13, 'Next month you should try  to focus on getting in more cardio and resistance training. This aspect of Food Lovers is vital for good health and optimal weight loss so treat is as an important element in your plan. Schedule workouts in advance and stick to your guns - remember, it''s your body and your life - make the most of it!\r\n', 2, 2, 0),
(97, 14, 'Today you did a good job eating your Fat Loss Plates and snacks in balance, but they all seem to be on the high side.  Try cutting back your portion sizes a little tomorrow for better results.\r\n', 0, 3, 0),
(98, 14, 'You are good at balancing your Fat Loss Plates and snacks, but overall, they tend to be on the larger side of the scale.  For faster results, review the foods you''ve been eating and compare them to the portion charts and see where you can make some cutbacks tomorrow!\r\n', 0, 3, 0),
(99, 14, 'Today your Fat Loss Plates were balanced but they all tended to be on the high side.   Cut back on your portions to accelerate your results!\r\n', 0, 3, 0),
(100, 14, 'While you''re eating the correct balance of foods in your Fat Loss Plates, your portion sizes this week are leaning toward the larger end of the scale. Try reducing your overall portion sizes a bit for faster weight loss.\r\n', 1, 3, 0),
(101, 14, 'Though you''ve got the Fat Loss Plate balancing act down well, it seems like your portion sizes on the whole are too large. Try cutting down the portion sizes a bit when possible next week to maximize your fat burning potential. \r\n', 1, 3, 0),
(102, 14, 'Your meals and snacks are well-balanced in terms of food groups, but are a little too large in general. Whenever possible next week, err on the lower side of the portion scale to burn more fat and accelerate weight loss. \r\n', 1, 3, 0),
(103, 14, 'Did you lose weight this month? If your results didn''t meet your expectations, your portion sizes might be too large. Your Fat Loss Plate balance is correct, but you might consider cutting back your portions slightly next month and see what happens! \r\n', 2, 3, 0),
(104, 14, 'This month you did a great job balancing your Fat Loss Plates, but it seems as if your portions are still a bit large. Sometimes in Food Lovers we give you a size range for certain foods, so try eating in the smaller end of the range to optimize your fat loss next month.\r\n', 2, 3, 0),
(105, 14, 'In Food Lovers you''re often given a size range when it comes to portions, and it seems this month you ate toward the larger end of that range, which may be affecting your results. Next month, try eating smaller portions and see what happens. Note in your Food Journal how you''re feeling with each new food change.\r\n', 2, 3, 0),
(106, 15, 'Today you consumed too much sodium. Excess sodium can elevate blood pressure, make you feel sluggish and cause you to retain water. Tomorrow, cut back on high sodium foods and drink plenty of water.\r\n', 0, 3, 0),
(107, 15, 'Your meals and snacks today were very high in sodium. Remember that excess sodium can be harmful to your system, so read food labels and add spices and other flavorings to your food to lower your intake tomorrow.\r\n', 0, 3, 0),
(108, 15, 'It seems you had a lot of sodium in your meals and snacks today. Remember that sodium is one of this Hidden Enemies of Fat Loss. Cut back on your intake from here on out to keep your metabolism running smoothing and your results coming quickly.\r\n', 0, 3, 0),
(109, 15, 'This week your meals and snacks were high in sodium. Excess sodium is linked to high blood pressure, edema and kidney stones, so next week cut back your sodium so you''re not getting any more than 2300 mg daily.\r\n', 1, 3, 0),
(110, 15, 'The daily recommended intake of sodium is less than 2300 mg, but this week your meals exceeded that. Look up the foods you recorded in your journal and see where you can make adjustments to bring your levels into the acceptable zone next week.\r\n', 1, 3, 0),
(111, 15, 'Your meals and snacks this week were very high in sodium, which can cause bloating, water retention,  and high blood pressure - none of which are good for weight loss! Rein in your sodium intake next week, and use Day 10 of the "21-Day Metabolism Makeover" as a guide to healthier choices.\r\n', 1, 3, 0),
(112, 15, 'This month your intake of sodium was pretty high. Did you eat a lot of prepackaged and processed foods? These items notoriously contain a lot of added sodium for preservation. Cutting back on those items will do wonders to lower your sodium intake in the coming month.\r\n', 2, 3, 0),
(113, 15, 'You had way too much sodium this month! While sodium does not have calories, taking in too much can mess with your body''s internal systems, slowing your metabolism and throwing your goals askew.  Next month make it your goal to lower that amount to less than 2300 mg a day. Use alternative seasonings, herbs and spices instead of salt to help out!\r\n', 2, 3, 0),
(114, 15, 'Your sodium intake for this month was too high, so next month try to cut it back a bit. Avoid processed and packaged foods and replace them with whole or homemade items, and shelve the saltshaker. Remember: one teaspoon of salt contains 2300 mg - your entire daily recommended amount! \r\n', 2, 3, 0),
(115, 16, 'Today your meals and snacks contained too much saturated fat. These fats have been linked to all sorts of bad things like heart disease, cancer and obesity, so limit your intake to 10 grams or less daily.\r\n', 0, 3, 0),
(116, 16, 'Your saturated fat intake was pretty high today. Watch for these fats in fried foods, breaded foods, and fatty meats like bacon and pork sausage. \r\n', 0, 3, 0),
(117, 16, 'Be careful: your intake of saturated fat was high today! Not only are saturated fats bad for your heart, they also contain a lot of calories. Too many calories from fat (or other nutrients) means fat stoage rather than fat loss! Cut back on your fat intake tomorrow to stay in Fat Burning Mode.\r\n', 0, 3, 0),
(118, 16, 'This week your meals and snacks were pretty high in saturated fat. These fats are notorious bad guys, doing damage to your heart, brain and other vital systems. Plus they contain 9 calories per gram, like other fats, and overeating them can slow your weight loss process. Next week, replace some of these saturated fats with heatlhy fats such as avocado and olive oil.\r\n', 1, 3, 0),
(119, 16, 'This week your diet was really high in saturated fats. Next week make a few different food choices: pick lean turkey or beef over fatty meats, skinless chicken breasts over thighs, and fish over prime rib to lower your intake of saturated fat.\r\n', 1, 3, 0),
(120, 16, 'Saturated fats are not good, and this week you ate a lot of them. All animal sources of protein contain saturated fat but you can choose better options to reduce your intake: chicken breasts, fish, salmon and lean beef are good options.\r\n', 1, 3, 0),
(121, 16, 'This month your diet was fairly high in saturated fats. Remember that saturated fats have the same number of calories as regular fats but they react differently in the body, and an excess have been linked to several serious diseases. Next month cut back on your intake of foods such as bacon, sausage and fatty steak. Choose leaner meats and low-fat cheeses to lower your overall saturated fat intake.\r\n', 2, 3, 0),
(122, 16, 'You had too much saturated fat this month! Inventory your food journal then review the section on saturated fats in Day 6 of the "21-day Metabolism Makeover."  See where you can make changes to your plan that will lower this intake a good deal.\r\n', 2, 3, 0),
(123, 16, 'You need to be more aware of your intake of saturated fats - this month is was high. To reduce your intake of this heart-harming fat in coming months, trade fatty meats for lean and high fat dairy for low fat options. \r\n', 2, 3, 0),
(124, 17, 'Your diet today was pretty low in fiber. Remember that fiber is a vital part of your weight loss plan, helping you feel full and staving off cravings and hunger! Eat more whole grains, fruits and veggies to add more fiber to your day tomorrow.\r\n', 0, 3, 0),
(125, 17, 'Today you didn''t get enough fiber! Having fiber with every meal slows the conversion and absorption of nutrients in the gut, which regulates your blood sugar levels and keeps you in Fat Burning Mode! Be more conscious of your intake tomorrow!\r\n', 0, 3, 0),
(126, 17, 'Oops! You didn''t get enough fiber in your meals and snacks today. Add some dried fruit to your cereal or some veggies to your pizza to increase your daily amount tomorrow!\r\n', 0, 3, 0),
(127, 17, 'This week you didn''t get enough fiber in your diet. A good way to increase your fiber intake for next week would be to eat more whole grains, fruits and vegetables, as well as beans, nuts and seeds. \r\n', 1, 3, 0),
(128, 17, 'Getting enough fiber is essential for fat loss! This week you fell short of your mark and may have slowed your digestion and fat burning furnace. This coming week, be conscious of your fiber intake. Refer to the "21-day Metabolism Makeover" to remind yourself of good fiber options!\r\n', 1, 3, 0),
(129, 17, 'Your mom was right - you need to eat more vegetables! This week you didn''t get enough fiber in your diet. Review your lists of whole foods, vegetables, and grains and choose from these items come meal time to ensure you''re gettng enough fiber.\r\n', 1, 3, 0),
(130, 17, 'This month you didn''t get enough fiber in your diet! Fiber is important for digestion, satiety and blood sugar regulation, and it also helps prevent certain types of cancer while reducing cholesterol. Next month make it a goal to get more fiber in your diet to stay healthy inside while looking slim and trim on the outside!\r\n', 2, 3, 0),
(131, 17, 'You didn''t get enough fiber this month! Dietary fiber is a key component to weight loss since it helps regulate blood sugar and promotes a feeling of fullness, so you don''t have excessive food cravings. Look through your food journal and see where you can make changes to your plan that will add fiber to your meals.\r\n', 2, 3, 0),
(132, 17, 'Getting plenty of fiber in your diet needs to be a goal of yours next month, as you didn''t get nearly enough this month. Fiber helps lower cholesterol and risk of disease while promoting satiety in the gut, preventing hunger and cravings! Make small changes next month to make a big difference in your fiber intake, such as trading white breads for whole grain, white rice for brown, and adding raisins or almonds to your cereal.\r\n', 2, 3, 0),
(133, 18, 'Today you drank 8-11 glassses of water - good job! You''re on your way. Tomorrow, shoot for 12 glasses or more and you''re golden!\r\n', 0, 3, 0),
(134, 18, 'You drank 8-11 glasses of water today! That''s great. Now try a little harder and get 12+ tomorrow. Bring a water bottle with you everywhere so you always have some on hand!\r\n', 0, 3, 0),
(135, 18, 'Awesome! You drank 8-11 glasses of water today. Shoot for 12+ tomorrow! Sip on water frequently during the day and if you go out to eat, alternate alcoholic beverages with full glasses of water.\r\n', 0, 3, 0),
(136, 18, 'This week you did a good job - 8-11 glass of water daily, but you can do better! Make it a goal to increase your intake to 12+ glasses next week. Bring a water bottle with you everywhere and avoid caffeinated beverages which have a diuretic effect.\r\n', 1, 3, 0),
(137, 18, 'You drank 8-11 glasses of water daily this week - good for you! The ideal amount you should shoot for next week is 12+ glasses, so you''re almost there. Have just a little more with meals and snacks and you''re sure to hit that mark!\r\n', 1, 3, 0),
(138, 18, 'This week you drank 8-11 glasses of water every day, which is awesome! With a little more effort you can make that 12+, the ideal number for optimal health and most importantly - fat burning! Make 12+ your goal for next week.\r\n', 1, 3, 0),
(139, 18, 'This month you consistently drank 8-11 glasses of water per day - good for you! Water is a very important part of your Food Lovers plan and getting enough means a more efficient metabolism and accelerated fat burning. Next month add just a little more water to your plan to reach 12+ glasses a day. You can do it!\r\n', 2, 3, 0),
(140, 18, 'You drank a lot of water this month - 8-11 glasses a day! Water keeps you hydrated while promoting a feeling of fullness. Next month, add at leastone more glass to your daily intake to really get your metabolism going and your fat burning in high gear!\r\n', 2, 3, 0),
(141, 18, 'You drank 8-11 glasses of water a day this month - nice job! Next month take it up one more notch and shoot for 12+ glasses every day. Carry a water bottle with you everywhere and sip on it frequently, or set an alarm to remind you to have a glass - whatever works for you to get the job done!\r\n', 2, 3, 0),
(142, 19, 'You''re on the right track to getting enough sleep but are still an hour or two short! The ideal number of sleeping hours is 7-8, so try to stay in bed a little longer tonight to optimize your fat burning potential!\r\n', 0, 3, 0),
(143, 19, 'The ideal number of hours you should sleep is 7-8, so you''re almost there! Shoot for another hour tonight to best enable your body to repair and rebuild as well as burn fat!\r\n', 0, 3, 0),
(144, 19, 'You''re still getting too little sleep, but are on the right track. Try to get one hour more tonight and see if it makes a difference in your energy levels!\r\n', 0, 3, 0),
(145, 19, 'This week you''re still not getting quite enough sleep. An hour more per night would be ideal. Refer back to Chapter 7 in the "21-Day Metabolism Makeover" for ideas to help you relax and get in that extra time in dream land.\r\n', 1, 3, 0),
(146, 19, 'This week you did pretty well, but could use one more hour of sleep per night to really put you into the ideal state. Next week strive to get that extra hour and take note if it makes a difference in your energy levels, alterness and fat loss results! \r\n', 1, 3, 0),
(147, 19, 'You''re almost perfect this week - just need another hour of sleep per night and you''ll be right as rain! Try shutting down your computer or clicking off the TV a little earlier next week to get that last hour of rejuvenating sleep!\r\n', 1, 3, 0),
(148, 19, 'This month you got 6-7 hours of sleep per night, which is just a little low. Ideally you should be getting 7-8 hours, so make it your goal next month to plan your days and evenings to get plenty of sleep and give your body time to repair and rebuild itself!\r\n', 2, 3, 0),
(149, 19, 'You didn''t get enough sleep this month, but you''re on the right track. Make it a priority next month to schedule your sleep time - it''ll do wonders for your energy, metabolism and enthusiasm! \r\n', 2, 3, 0),
(150, 19, '7-8 hours is the magic number for sleep, and this month you fell a little short of that goal. Numerous studies show that getting enough sleep has a dramatic effect on weight loss, so look over your schedule and see where you can make adjustments so you can get that valuable time in dream land!\r\n', 2, 3, 0),
(151, 20, 'Last night you got too much sleep! This can come from making poor food choices or depression, among other things. Investigate your journal and consult with your inner self to see what might be causing you to sleep so much.\r\n', 0, 3, 0),
(152, 20, 'Last night you slept nine hours or more. If it''s an isolated incident, not to worry, but if it keeps happening, you might want to investigate your diet, mood, and stress level, as well as your alcohol intake and prescription medications.\r\n', 0, 3, 0),
(153, 20, 'You slept more than 9 hours last night! Sleep is great, but sleeping too much can be a sign of other internal goings-on such as depression, fatigue or poor nutrition. Try to sleep only 7-8 hours tomorrow night!\r\n', 0, 3, 0),
(154, 20, 'This week you got 9 hours of more of sleep on several nights! Excessive sleeping can be a sign of depression, poor nutriiton, excessive alcohol consumption and other things. Look at your level of stress, mood and coping mechanisms to see if there are other factors involved, and strive for 7-8 hours every night. \r\n', 1, 3, 0),
(155, 20, 'This week there were several nights where you got more than 9 hours of sleep. The ideal number for optimal health is 7-8 hours, so try your best to limit yourself to that time frame. Set an alarm to get you up, or try going to bed a little later next week.\r\n', 1, 3, 0),
(156, 20, 'You got more than 9 hours of sleep on several occasions this week. Remember: 7-8 hours is the ideal range for sleeping; any more than that can slow your metabolism and lead to lethargy during the day. Next week shoot for that magic 7-8 hour mark!\r\n', 1, 3, 0),
(157, 20, 'This month you got 9 or more hours of sleep on many nights. Sleeping is a great time for your body to repair and rejuvenate itself, but too much sleep can lead to fuzzy-headedness, lethargy and depression in some instances. Look at your schedule coming up and plan to get 7-8 hours of sleep per night next month.\r\n', 2, 3, 0),
(158, 20, 'You slept more than 9 hours on many nights during this month. Your magic sleep number is 7-8 hours - this is all the time the body needs to rejuvenate itself and get ready to roll the next day. Next month, go to bed a little later or get up a little earlier to land in that magic bracket.\r\n', 2, 3, 0),
(159, 20, 'Getting too much sleep can be a bad thing, and this month you overdid it, getting nine hours or more on several occasions. The ideal number is 7-8 hours, so shoot for that next month. If you''re finiding is really difficult, look into your mood - depression can often make you sleep more than normal.\r\n', 2, 3, 0),
(160, 21, 'Hey, where are your Slow Carbs? Many of your meals today didn''t contain any. Remember that Slow Carbs contain lots of fiber, which is important for weight loss! Tomorrow make sure most of your meals and snacks contain Slow Carbs!\r\n', 0, 3, 0),
(161, 21, 'Today you didn''t eat enough Slow Carbs. Slow Carbs contain tons of vitamins, minerals and fiber, all of which contribute to weight loss and fat burning. Review the Portion Chart for Slow Carbs to get some ideas for tomorrow.\r\n', 0, 3, 0),
(162, 21, 'Did you forget to eat your Slow Carbs today? Seems like you did! Slow Carbs are an important part of the Food Lovers program, so tomorrow make sure you add some in!\r\n', 0, 3, 0),
(163, 21, 'This week many of your meals were devoid of Slow Carbs, which can have an adverse effect on your weight loss goals. Slow Carbs contain lots of fiber which can help you feel fuller longer, reducing cravings and helping you stick to your guns! Look over the portion charts for Slow Carbs to get some ideas for foods you can add to your plan next week!\r\n', 1, 3, 0),
(164, 21, 'This week you didn''t eat very many Slow Carbs. Granted,  they can be hard to come by if you''re on the run, but next week make it a point to eat plenty of them. Make some food ahead of time and carry it with you, or order salads at restaurants and veggies on sandwiches and burgers to get them in.\r\n', 1, 3, 0),
(165, 21, 'Many of your meals this week did not contain Slow Carbs, so your goal for next week is to increase that amount to further accelerate your fat-loss process. Add veggies to sandwiches, order a side salad at dinner, and have some berries in your cereal for breakfast. \r\n', 1, 3, 0),
(166, 21, 'This month your meals were lacking in Slow Carbs. Remember: your Fat Loss Plate should contain plenty of Slow Carbs to add bulk to your meals, making them last longer in your gut while promiting a healthy digestive system. Look back at the grocery lists and portion charts to see what constitutes a Slow Carb then make it a goal this month to add those into your plan!\r\n', 2, 3, 0),
(167, 21, 'You didn''t eat enough Slow Carbs this month. Ideally, you should be having one with just about every meal and snack to add satiety to a meal and fiber to your diet. Review your food journal and see where you can make small changes to your plan and add more Slow Carbs into the mix!\r\n', 2, 3, 0),
(168, 21, 'Slow Carbs are a really important part of the Food Lovers plan and this month you didn''t get enough of them. Many of your meals did not contain any at all, so make it a goal next month to have a Slow Carb with most meals and snacks whenever possible. \r\n', 2, 3, 0),
(169, 22, 'Today your meals and snacks were very high in cholesterol! Too much LDL (bad cholesterol) is bad for your heart, so limit your intake of foods like Fatty Proteins to keep your choleterol at bay\r\n', 0, 4, 0),
(170, 22, 'Today you had a very high cholesterol intake. Review your food journal and see where you can make changes to your food choices to lower your levels.\r\n', 0, 4, 0),
(171, 22, 'You had too much cholesterol in your meals and snacks today. For best results and optimal health, choose foods that are lower in cholesterol tomorrow.\r\n', 0, 4, 0),
(172, 22, 'This week you ate too many foods that were high in cholesterol. Excessive cholesterol intake can lead to heart disease, high blood pressure and stroke. Also the foods that contain it are typically very high in Fat. Next week, choose leaner Protein and dairy options and limit your egg yolks to one or two per serving. \r\n', 1, 4, 0),
(173, 22, 'This week your cholesterol intake was quite high. Review the level of cholesterol in the foods you commonly eat and see where you can make changes to your plan next week to reduce this level.\r\n', 1, 4, 0),
(174, 22, 'Your cholesterol intake for this week was high. An abundance of cholesterol in the system has been linked to heart disease and certain cancers, so next week learn about healthier food alternatives to your high fat and high cholesterol favorites to keep you in tip top shape!\r\n', 1, 4, 0);
INSERT INTO `fatloss_msg_desc` (`id`, `fmid`, `message`, `dayflag`, `priority`, `ispositive`) VALUES
(175, 22, 'This month your diet was very high in cholesterol. Since high levels of dietary cholesterol have been linked to obesity, heart disease and high blood pressure, it''s in your best interests to limit your intake of these foods. Review your food journal and see where you can make adjustments for next month that will bring your total cholesterol down.\r\n', 2, 4, 0),
(176, 22, 'Your diet contained an excess of cholesterol this month, so make it a goal next month to change that pattern: Choose leaner cuts of meat and dairy products that are low in fat. Use egg whites instead of whole eggs, or even an egg substitute, and try to bring your cholesterol content down.\r\n', 2, 4, 0),
(177, 22, 'You had a very high intake of cholesterol this month, which can be bad news for your body. High cholesterol is linked to heart disease, obesity and high blood pressure, so make it a goal next month to eat foods regularly that are healthier and lower in saturated fat and cholesterol.\r\n', 2, 4, 0),
(178, 23, 'Did you forget your vitamins today? Yes you did! Remember to take one every day for optimal health!\r\n', 0, 4, 0),
(179, 23, 'Hey you forgot your multivitamin today! A good way to remember to take them is to do it at the same time every day. Put the bottle on the kitchen counter right by the coffee maker or by your computer at the office.\r\n', 0, 4, 0),
(180, 23, 'You forgot your multivitamin today! Remember that your body needs these nutrients to be its best so be diligent about taking them daily!\r\n', 0, 4, 0),
(181, 23, 'Several times this week you forgot to take your vitamins! Your body needs these vitamins and minerals to function at its best, so find a way to remind yourself to take one every day for next week!\r\n', 1, 4, 0),
(182, 23, 'You forgot to take your Multi-vitamins this week. Even if you''re in a hurry you can still find time to swallow a few pills. Next week make a bigger effort to take one every day - Put the bottle on your keyboard at work and take it first thing, or in your purse to take one at lunch. \r\n', 1, 4, 0),
(183, 23, 'This week you forgot to take your multivitamin on many occasions. Now that you''re more active, you need more vitamins and minerals, so be more diligent in your efforts next week!\r\n', 1, 4, 0),
(184, 23, 'Many times this month you forgot to take your multi-vitamin. Remember that your body needs these nutrients to work at its highest potential, so make an effort next month to make that happen. Set reminders on your phone or computer to prompt you to take them once a day.\r\n', 2, 4, 0),
(185, 23, 'Several times this month you did not take your multi-vitamins. For optimal health and weight loss success, your body needs to work at its best. Next month make it a goal to take one every day!\r\n', 2, 4, 0),
(186, 23, 'This month you often forgot to take your multivitamin. Your body needs these nutrients to function at its best, so try your best next month not to skip this simple task. Find a way to take one every day and your body will thank you for it!\r\n', 2, 4, 0),
(187, 24, 'You forgot to take your 5-Way today! Remember that this is a good way to boost your results, so make sure you take it daily!\r\n', 0, 4, 0),
(188, 24, 'Today you forgot to take your 5-Way! The nutrients in your 5-Way help boost metabolism and improve fat-burning, so be sure to take it tomorrow!\r\n', 0, 4, 0),
(189, 24, 'You did not take your 5-Way today. To optimize fat loss and prevent cravings, it''s important to remember to take it daily!\r\n', 0, 4, 0),
(190, 24, 'This week you often forgot to take your 5-Way. Taking it daily can help boost your metabolism, improve fat burning and prevent cravings! Next week make it a goal to take it every day!\r\n', 1, 4, 0),
(191, 24, 'This week you didn''t regularly take your 5-Way. To optimize your fat burning potential you should be taking it every day. Find a way next week to remind yourself to take your 5-Way - set a prompt on your phone or computer to nudge you!\r\n', 1, 4, 0),
(192, 24, 'Your 5-Way bottle is way too full - because you forgot to take it this week! Remember: 5-Way is a great supplement to enhance your fat-burning process, so make it a point to take it regularly next week.\r\n', 1, 4, 0),
(193, 24, 'This month you didn''t regularly take your 5-Way supplement. Because 5-Way helps boost your metabolism, it''s good to take it on a daily basis. Make it a goal next month to take your 5-Way regularly, helping acceperate your fat loss and reaching your goals faster!\r\n', 2, 4, 0),
(194, 24, 'You didn''t take your 5-Way supplement regularly this month. 5-Way can help your body fine-tune its fat-burning machine, increasing your weight loss potential. Make a point of taking it regularly next month and see if it makes a difference in your energy and your results! \r\n', 2, 4, 0),
(195, 24, 'This month you didn''t take your 5-Way on a daily basis. This fat-loss formula is the ideal supplement for those wishing to take their results to the next level, so if you''ve got it, be sure to take it! \r\n', 2, 4, 0),
(196, 25, 'Great job!  All of your meals were Fat Loss Plates today, which means you kept your blood sugar from spiking, and kept your body in Fat Burning Mode.  Keep up the good work!\r\n', 0, 1, 1),
(197, 25, 'Fabulous! All your meals and snacks today were perfect Fat Loss Plates! You kept your metabolism running in high gear and moved one step closer to your weight loss goals!\r\n', 0, 1, 1),
(198, 25, 'Today you ate perfectly - all your meals were Fat Loss Plates! Your nutrition is right on track and your body is in full Fat Burning Mode!\r\n', 0, 1, 1),
(199, 25, 'You did awesome this week! All your meals were Fat Loss Plates and your snacks were perfectly portioned. You kept your body in Fat Burning Mode and ate in such a way that you burned fat all day long!\r\n', 1, 1, 1),
(200, 25, 'You really made your meals work for you this week - they were all Fat Loss Plates and your nutrition was spot on. Great job! Keep it up next week!\r\n', 1, 1, 1),
(201, 25, 'This week you did great - all your meals were Fat Loss Plates and you kept your metabolism geared up and burning fat all week! Keep up the good work!\r\n', 1, 1, 1),
(202, 25, 'This month you did great! All your meals were perfect Fat Loss Plates and you did a terrific job balancing your foods and eating everything in the right portions. If you keep this up, you''ll reach your weight loss goals in no time!\r\n', 2, 1, 1),
(203, 25, 'You deserve a pat on the back! This month all your meals were Fat Loss Plates and you ate in such a way that you burned fat all day long! Great job. Keep it up next month and keep moving forward toward your goals!\r\n', 2, 1, 1),
(204, 25, 'Excellent job! All your meals this month were Fat Loss Plates! Your blood sugar was stable, your body was burning fat and you were shedding pounds! Keep up the great work!\r\n', 2, 1, 1),
(205, 26, 'You ate every 2-3 hours today! Your body knows that another meal is always coming, so instead of storing food as fat, it''s burning it as fuel.  Nice job!\r\n', 0, 1, 1),
(206, 26, 'Good job! You ate your meals and snacks every 2-3 hours, the ideal time frame! Your blood sugar was stable and even, and your body stayed in Fat Burning Mode all day!\r\n', 0, 1, 1),
(207, 26, 'Today you ate every 2-3 hours - excellent! Your body was never starving or without food and you were burning fat as fuel all day long.\r\n', 0, 1, 1),
(208, 26, 'This week you ate every 2-3 hours - excellent! When you have a regular intake of food your body never reverts to Fat Storing Mode - you drop pounds and inches like water. Great job! Keep it up next week!\r\n', 1, 1, 1),
(209, 26, 'You did a really great job this week of eating every 2-3 hours and sticking with your plan. Your body had a constant supply of calories and you probably never ''crashed'' at all! Keep up the great work!\r\n', 1, 1, 1),
(210, 26, 'You did a terrific job this week, eating every 2-3 hours and supplying your body with what it needs to stay in Fat Burning Mode all day long! Next week, do exactly what you did this week and you''re on your way to remarkable results!\r\n', 1, 1, 1),
(211, 26, 'This month you did such a great job of eating every 2-3 hours! You kept your blood sugar even and stable, and your body in Fat Burning Mode for the whole month. If you keep it up like this you''ll reach your weight loss goals in no time!\r\n', 2, 1, 1),
(212, 26, 'Terrific job! You successfully ate your meals and snacks every 2-3 hours this month, which means you were continuously in Fat Burning Mode! How do you feel? Are you closer to reaching your goals? We bet you are! Keep it up!\r\n', 2, 1, 1),
(213, 26, 'You did a fabulous job this month! Not only did you eat your meals and snacks every 2-3 hours, you also kept your body in Fat Burning Mode for four straight weeks. What a great accomplishment! Stick to it - you''re getting so much closer to your goals!\r\n', 2, 1, 1),
(214, 27, 'Hello! You waited more than 30 minutes after waking to eat your first meal or snack! It''s very important to "break your fast" early, to get your body''s metabolism back into Fat Burning Mode, so eat something!  See the "I Love To Eat Cookbook" for some easy and fast breakfast ideas.\r\n', 0, 1, 1),
(215, 27, 'Today you didn''t break your fast! Waiting more than 30 minutes after waking to eat a meal or snack can put you into Fat Storing Mode. So chow down when you rise to get your body''s internal fire revving in high gear straightaway.\r\n', 0, 1, 1),
(216, 27, 'Remember to eat within 30 minutes of rising! You forgot today. This gives your body fuel to work with right away and stokes your fat burning fire the rest of the day.\r\n', 0, 1, 1),
(217, 27, 'So you''re not a morning person, hey? Even so, you need to eat something - a meal or a snack - within 30 minutes of rising. This week you didn''t quite get there, but next week try your best to remedy that situation.\r\n', 1, 1, 1),
(218, 27, 'This week you didn''t eat within 30 minutes of getting up. Sometimes it''s hard to eat first thing, but even something small like a piece of fruit, a yogurt, or a smoothie can do wonders for your metabolism. Try having something small next week and see how you feel!\r\n', 1, 1, 1),
(219, 27, 'Eating within a half hour of rising gets your metabolism going right off the bat! You weren''t so successful with that idea this week, but next week do your best. At least try it - all you have to lose is some more fat!\r\n', 1, 1, 1),
(220, 27, 'Some people have a hard time eating in the morning, and you seem to be one of them! This month you didn''t eat within 30 minutes of rising very often. So next month, even if you''re not a ''breakfast'' person, have something small to literally ''break your fast'' and move your body from sleep mode into Fat Burning Mode right away. The rest of the day you''ll be burning fat like a champ! \r\n', 2, 1, 1),
(221, 27, 'This month you didn''t eat within 30 minutes of rising very often. Try to be more diligent in the coming month about eating a breakfast of some kind - be it a small snack or an actual meal - to kick your body into high gear and get your metabolism going right away in the morning. \r\n', 2, 1, 1),
(222, 27, 'Because you''ve been sleeping for 7-8 hours during the night (we hope!) your body is hungry! This month you didn''t feed it quickly enough, giving it sustinance within 30 minutes of rising like you should have. Next month, make sure that happens, even if it means getting up 10-15 minutes earlier to make a smoothie or some eggs. It''s thatimportant!\r\n', 2, 1, 1),
(223, 28, 'Nice job! You got between 7-8 hours of sleep last night. That is the ideal range for proper recovery, repair and rebuilding of your body''s mental and physical being. Keep it up!\r\n', 0, 1, 1),
(224, 28, 'Last night you got 7-8 hours of sleep - that''s great! Sleep is so important when trying to lose weight, so keep up the good work.\r\n', 0, 1, 1),
(225, 28, 'You got 7-8 hours of sleep last night - good for you! Many studies show that that is the exact amount the body needs to function at its best. Nice job!\r\n', 0, 1, 1),
(226, 28, 'Nice! This week you got 7-8 hours of sleep each night. Your body was well-rested and able to function at its best, meaning you were able to think clearer, work out harder, and eat better!\r\n', 1, 1, 1),
(227, 28, 'This week you slept 7-8 hours every night - great job! Sleep is so important when trying to lose weight as it gives your body (and mind!) time to rest and rejuvenate and prepare for the next day. Stick to it next week!\r\n', 1, 1, 1),
(228, 28, 'You slept 7-8 hours each night this week - that''s great! A well-rested body is a fat-burning body, and yours is definitely on the right track. Keep it up!\r\n', 1, 1, 1),
(229, 28, 'This month you consistently slept 7-8 hours a night! That is the magic number for optimal repair and rebuilding of your body''s mental and physical systems, accelerating recovery and aiding in fat loss. Make this new habit a lifstyle and you''ll be a fat burning machine for life!\r\n', 2, 1, 1),
(230, 28, 'You did a great job this month with your sleep, getting between 7-8 hours every night. When trying to lose weight sleep is so important, and those with the most success value their sleep as much as their workouts and nutrition! Keep it up next month!\r\n', 2, 1, 1),
(231, 28, 'Excellent job - this month you were so good at getting in your 7-8 hours of sleep each night. Sleep is as important in weight loss as nutrition and activity, so maintain this habit and continue to do well next month!\r\n', 2, 1, 1),
(232, 29, 'Awesome job this week! You exercised consistently, getting in plenty of cardio and resistance training and turning your body into a fat burning machine! Keep it up next month!\r\n', 1, 1, 1),
(233, 29, 'You did great this week with your cardio and resistance training! You created a regular schedule and stuck to it, which isn''t always easy to do - good job!\r\n', 1, 1, 1),
(234, 29, 'Your cardio and resistance program this week was spot-on  - excellent work! Making time to exercise is good for your body and your mind and will get you to your goal weight in no time!\r\n', 1, 1, 1),
(235, 29, 'You were an exercise rock star this month! You did lots of cardio and resistance training, burning tons of fat and calories. You helped optimize your results by boosting your metabolic rate, and are moving ever closer to your goal. Stick to it next month and you''ll be where you want to be in no time at all!\r\n', 2, 1, 1),
(236, 29, 'You did really great this month with your cardio and resistance training program. Regular exercise is a cornerstone of Food Lovers when it comes to results, so keep it up next month and keep that fat burning off!\r\n', 2, 1, 1),
(237, 29, 'This month you did awesome with your exercise program! You consistently worked out on a regular basis and got in plenty of both cardio and resistance training. These two elements combined are key to elevating your metabolism and boosting results, so great job!\r\n', 2, 1, 1),
(238, 30, 'You drank 12+ glasses of water today! This is the perfect amount of water to keep you hydrated and keep your metabolism moving. Keep drinking that H2O!\r\n', 0, 2, 1),
(239, 30, 'Today you drank 12+ glasses of water! Your diligence is paying off - water helps the digestive process, aids metabolism and keeps you feeling full. Nice job!\r\n', 0, 2, 1),
(240, 30, 'You got in your 12+ glasses of water today - great job. It is sometimes hard to get it all in but you managed with flying colors!\r\n', 0, 2, 1),
(241, 30, 'This week you drank your 12+ glasses of water every day! This is a great accomplishment and will help you feel great, lose weight and burn fat! Keep it up next week!\r\n', 1, 2, 1),
(242, 30, 'You drank your 12+ glasses of water every day this week! Water is so vital to life and good health, and drinking enough of it makes your body function at its best. Nice job!\r\n', 1, 2, 1),
(243, 30, 'This week you drank 12+ glasses of water each day! Not only did you stay hydrated, you also helped your body break down food and metabolize fat. Stick with it!\r\n', 1, 2, 1),
(244, 30, 'This month you did a great job of drinking your water! You consistently had 12+ glasses a day, helping your body break down foods and fats and keeping you hydrated. Stick to this new way of drinking and your body will thank you for it!\r\n', 2, 2, 1),
(245, 30, 'You drank 12+ glasses of water every day this month! How did you do it? Did you carry around a water bottle? Set an alarm to remind yourself? Whatever you did it worked! Now keep it up next month and you''ll be that much closer to your goals!\r\n', 2, 2, 1),
(246, 30, 'You did such a great job this month drinking your water. You successfully had 12+ glasses every day, hydrating your system and helping your body function at its best. Keep on drinking that water and you''ll turn your body into a well-oiled fat burning machine!\r\n', 2, 2, 1),
(247, 31, 'You were spot on with your snacking today! Not only were they the correct size (100-200 calories for men, 75-150 for women) but they were balanced and healthy. Nice job!\r\n', 0, 2, 1),
(248, 31, 'Great job with your snacking today! You ate the right size snacks at the right times of the day to keep your metabolism rolling along in high gear. Keep it up!\r\n', 0, 2, 1),
(249, 31, 'Your snacking was right on target today. Your snacks were healthy and balanced and contained enough calories to tide you over until mealtime - perfect!\r\n', 0, 2, 1),
(250, 31, 'This week your snacking was awesome! Each one was right within your target calorie range - not too big or too small - which means your metabolism was running in high gear all day!\r\n', 1, 2, 1),
(251, 31, 'You did a great job with your snacking this week. Sometimes it''s hard to get a handle on snacks, but you''re already a pro. Keep it up!\r\n', 1, 2, 1),
(252, 31, 'Terrific job this week with your snacks. You kept them in your calorie range and made them healthful and balanced. Nice!\r\n', 1, 2, 1),
(253, 31, 'This month your snacking was pretty close to perfect! You chose foods within your calorie range (100-200 cal for men 75-150 for women), giving you plenty of energy and stoking your fat-burning furnace. Keep it up next month!\r\n', 2, 2, 1),
(254, 31, 'Snacking is so important to the Food Lovers system and you''ve got it down! This month you ate the correct kinds of snacks in the correct portions, providing your body with the energy it needed to perform at its best while still burning fat as fuel. Stick to the plan you''ve been following next month and you''re sure to reach your goals in no time!\r\n', 2, 2, 1),
(255, 31, 'You did such a great job this month with your snacking! Properly portioned snacks help keep your blood sugar stable while stoking your metabolic furnace, all of which translate to maximum fat burning! Next month, try to do it again!\r\n', 2, 2, 1),
(256, 32, 'Your meals today did not contain a lot of sodium - nice job! You''ll probably notice you''re not retaining a lot of water and that you feel less sluggish. Keep it up!\r\n', 0, 3, 1),
(257, 32, 'You made some excellent low-sodium food choices today. Eating this way will help prevent bloating and edema as well as high blood pressure. Nice job!\r\n', 0, 3, 1),
(258, 32, 'Today you did a great job of choosing low-sodium food options. A reduced sodium intake can reduce water retention and lower blood pressure, so stick to it!\r\n', 0, 3, 1),
(259, 32, 'This week you did a terrific job of eating foods low in sodium. A low-sodium diet can help the body''s metabolism function better while preventing diseases such as high blood pressure. Look through your cabinet and find more low-sodium foods to try next week!\r\n', 1, 3, 1),
(260, 32, 'Nice job this week with your sodium - your levels were pretty low and your food choices were wise. Make it a goal next week to try the same strategy - it''s working!\r\n', 1, 3, 1),
(261, 32, 'This week you did a great job keeping your sodium intake to a minimum. A low sodium diet is ideal for healthy body function and helps prevent disease in the long run. Keep it up!\r\n', 1, 3, 1),
(262, 32, 'This month you were great about making low-sodium food choices. How did you do it? Did you use herbs and spices instead of salt? Use fresh veggies instead of canned? Choose low-sodium soups? Whatever you did, it is working for you! Try it again next month!\r\n', 2, 3, 1),
(263, 32, 'Nice job this month in eating a low sodium diet. You''re setting your body up for metabolic success while helping lower your risk of high blood pressure and edema. Carry this new healthy way of eating into next month for continued success!\r\n', 2, 3, 1),
(264, 32, 'You did just great this month eating a low sodium diet! The foods you chose were healthy and clean and did wonders for your metabolism and your fat-burning process. Carry on!\r\n', 2, 3, 1),
(265, 33, 'Excellent job today - the foods you chose were low in saturated fat and will keep you lean and mean! Stick to it!\r\n', 0, 3, 1),
(266, 33, 'Today you ate foods that were low in saturated fat. This is great news for your body and your metabolism, so keep up the good work!\r\n', 0, 3, 1),
(267, 33, 'A diet low in saturated fat is ideal - and today you hit the mark. Choosing heart-healthy foods that are low in saturated fat make your metabolism zip along!\r\n', 0, 3, 1),
(268, 33, 'This week you did a really great job choosing foods low in saturated fat. Not only are you giving your body cleaner fuel to burn, you''re also helping prevent disease such as high blood pressure and heart attacks. Nice job!\r\n', 1, 3, 1),
(269, 33, 'You did a nice job this week eating foods low in saturated fat. It''s hard to do sometimes but you accomplished that feat and gave your body a boost in the right direction. Stick to your guns next week as well!\r\n', 1, 3, 1),
(270, 33, 'You were a champion this week when it came to eating foods low in saturated fat! Making healthier food choices will help prevent disease while giving you more energy and stamina than ever before. Good work.\r\n', 1, 3, 1),
(271, 33, 'This month you did a really great job making healthy food choices that were low in saturated fat. Eating foods such as the ones you''ve been choosing helps prevent heart disease and stroke while giving your metabolism the fuel it needs to run in high gear, burning tons of fat and moving you toward your goals. Keep it up!\r\n', 2, 3, 1),
(272, 33, 'Nice! This month you were a star when it came to eating foods that were low in saturated fat. Reducing the number of these Fats in your diet can help prevent major diseases such as diabetes and heart attack. Eating healthier foods in their place will give you more energy and stamina and keep you moving through next month as well!\r\n', 2, 3, 1),
(273, 33, 'You ate really well this month, limiting the amount of saturated fat you ate. Sure the occasional cheeseburger is gonna happen, but when you balance that out with other options that are low in saturated fat, you come out on top. Keep up the great work next month as well!\r\n', 2, 3, 1),
(274, 34, 'Congrats - today you ate plenty of fiber, helping your body move food through your digestive tract and helping keep hunger at bay!\r\n', 0, 3, 1),
(275, 34, 'You did a nice job eating fiber today. Chances are you felt more full and were able to stave off cravings like a champ!\r\n', 0, 3, 1),
(276, 34, 'Today you ate plenty of fiber - great job! Fiber makes your meals more satisfying while curbing hunger - two things that help with weight loss!\r\n', 0, 3, 1),
(277, 34, 'This week you ate a terrific amount of fiber! Fiber is so important to a healthy body as it works to help your metabolism while also helping prevent diseases such as colon cancer! Keep it up!\r\n', 1, 3, 1),
(278, 34, 'Your fiber intake this week was terrific! Whole grains, veggies, fruit, nuts, and seeds not only taste great but also contain tons of fiber - we bet you ate a lot of those this week. Eat some more next week!\r\n', 1, 3, 1),
(279, 34, 'You definitely made a conscious effort to eat your fiber this week! Fiber goes a long way to help with weight loss, making meals more satisfying and bringing bulk to your digestive system. Nice work!\r\n', 1, 3, 1),
(280, 34, 'This month was a fiber-ful one for you! You consistently ate plenty of fiber to make your meals more satisfying and filling while giving your digestive system some roughage to work with. Eating a diet high in fiber can also help prevent disease, so stick to it next month and beyond!\r\n', 2, 3, 1),
(281, 34, 'You did a really great job this month with your fiber intake! Did you feel more full? Did your meals and snacks stick to your ribs a little longer? We bet they did! Satiety is one of the key benefits of fiber, and can help prevent overeating and binge eating when you''re trying to lose weight. Keep up the good work next month!\r\n', 2, 3, 1),
(282, 34, 'Excellent work - you ate a ton of fiber this month, and kept your metabolism and digestive system rolling along at high speed. Fiber is an important part of the Food Lovers system and getting enough of it can assist in weight loss. Make it your goal to eat plenty of fiber again next month and keep your results coming!\r\n', 2, 3, 1),
(283, 35, 'Awesome - you ate a lot of Slow Carbs today! You gave your body plenty of fiber and roughage to add bulk to your meals and prevent overeating. Nice work!\r\n', 0, 3, 1),
(284, 35, 'You ate a good amount of Slow Carbs today, giving your body the fiber it needs, as well as additional water, vitamins, minerals and other nutrients!\r\n', 0, 3, 1),
(285, 35, 'You were great about eating your Slow Carbs today! Slow Carbs add bulk to your meals so you don''t get hungry as fast, helping you stick to your weight loss goals!\r\n', 0, 3, 1),
(286, 35, 'This week you were a Slow Carb champion! Many of your meals contained this important weight-loss element, and helped keep you fuller longer and gave your body some good fiber to boot. Nice work!\r\n', 1, 3, 1),
(287, 35, 'You ate plenty of Slow Carbs this week - excellent! You helped increase the bulk and satiety of your meals while slowing the digestion process of Fast Carbs and Protein in the body. Perfect!\r\n', 1, 3, 1),
(288, 35, 'You were great about getting in your Slow Carbs this week. Having plenty of Slow Carbs means your meals keep you fuller longer and you get penty of fiber to help ward of diseases such as colon cancer. Keep it up next week!\r\n', 1, 3, 1),
(289, 35, 'This month you did a really great job eating your Slow Carbs and making your Fat Loss Plates balanced and whole. Remember that Slow Carbs add bulk to your meals, meaning they stay in your stomach longer, slowing the digestive process and staving off hunger longer. Stick to this plan next month and you''ll continue to burn fat and move toward yuor goals!\r\n', 2, 3, 1),
(290, 35, 'You did a really great job eating your Slow Carbs this month! Slow Carbs work in the Food Lovers system to help prevent cravings, hunger and binge eating by adding bulk to your meals. Continue to eat plenty of Slow Carbs again next month to maintain that forward progress!\r\n', 2, 3, 1),
(291, 35, 'Excellent! You ate a solid amount of Slow Carbs this month, helping your body process and digest food, burn fat, and prevent diseases. Who knew a few veggies and fruits could be so powerful, right? Review your Food Journal and take note of how you did it this month, then replicate that process next month!\r\n', 2, 3, 1),
(292, 36, 'Hey nice job! Your meals and snacks today were low in cholesterol! You gave your body healthy, whole foods to use in its weight loss battle. \r\n', 0, 4, 1),
(293, 36, 'Today your cholesterol intake was good! Choosing leaner cuts of meat and low-fat foods makes a big difference in your weight loss journey. Nice work!\r\n', 0, 4, 1),
(294, 36, 'You ate a low-cholesterol diet today - excellent work! You made your heart happy and kept your metabolism running with your lean, mean food choices!\r\n', 0, 4, 1),
(295, 36, 'This week you did an excellent job choosing low-cholesterol foods! Eating a leaner diet helps prevent disease such as high blood pressure, stroke and heart attack while also giving your body clean foods to assimilate and use to burn fat! \r\n', 1, 4, 1),
(296, 36, 'Nice work this week eating a diet low in cholesterol. Too much cholesterol can work against you, clogging arteries and making you feel tired and sluggish. We bet you felt awesome this week and ready to take on the world! Keep it up next week!\r\n', 1, 4, 1),
(297, 36, 'This week you chose lots of heart-healthy low cholesterol foods, which can do wonders for your heart and body. Not only do eating products low in cholesterol help your arteries, it also helps your metabolism! Make it a point to eat this way more often!\r\n', 1, 4, 1),
(298, 36, 'This month you really did a great job choosing foods low in cholesterol and making your diet more heart-healthy. High cholesterol is linked to heart disease, and choosing low cholesterol foods can prevent such issues. Also, many high cholesterol foods are also high in saturated fats, so cutting back on them also means you''re cutting back on the other bad guy too! Nice work!\r\n', 2, 4, 1),
(299, 36, 'This month you ate a diet low in cholesterol - awesome! Low cholesterol foods work for your body instead of against it, helping stoke your metabolism and moving you toward your weight loss goals. Keep it up next month and you''ll have seemingly unlimited energy!\r\n', 2, 4, 1),
(300, 36, 'You were really good about eating low cholesterol foods this month! Choosing to reduce the amount of cholesterol in our diet can help prevent disease while accelerating metabolism. What more could you ask for? Read back through your Food Journal and see where you made changes. Make a note of that and continue with it next month.\r\n', 2, 4, 1),
(301, 37, 'You took your multi-vitamin today - nice! You''re giving your body extra nutrients to run in top gear all day long!\r\n', 0, 4, 1),
(302, 37, 'Today you took your multi-vitamin, providing your body with essential elements it needs to be its best!\r\n', 0, 4, 1),
(303, 37, 'You took your multi-vitamin today which is great! Your body works even more efficiently with these vital vitamins and minterals.\r\n', 0, 4, 1),
(304, 37, 'This week you were diilgent about taking your mutli-vitamin - keep it up! You''re providing your body with essential nutrients it needs to be strong and healthy.\r\n', 1, 4, 1),
(305, 37, 'You took your multi-vitamin reglarly this week - excellent. This means your body had extra nutrients and vitamins on hand when it needed them.\r\n', 1, 4, 1),
(306, 37, 'This week you took your multi-vitamin regularly, providing your body with needed nutrients to work in high gear like you''re asking it to. Keep it up!\r\n', 1, 4, 1),
(307, 37, 'This month you consistently took your multi-vitamin! This is good news for your body which is trying to work in high gear all day long burning fat! Providing it with the extra nutrients is key to lasting weight loss.\r\n', 2, 4, 1),
(308, 37, 'Nice job - you''re a vitamin-star and consistently took your multi this month. You know now that your body worked at its top speed day in and day out. Stick to it!', 2, 4, 1),
(309, 37, 'You were really consistent this month about taking your multi-vitamin! Regular supplementation with vitamins and minerals works to help your body assimilate food, create enzymes and other essential processes. Give your body what it needs again next month, too!\r\n', 2, 4, 1),
(310, 38, 'Hey nice job - you took your 5-Way today! You gave your metabolism a boost to help it burn fat!\r\n', 0, 4, 1),
(311, 38, 'You took your 5-Way today! 5-Way helps break down your food into energy so you can keep your body running in high gear all day long!\r\n', 0, 4, 1),
(312, 38, 'Your metabolism thanks you for taking your 5-Way today! With plenty of vitamins, minerals and other natural ingredients, 5-Way helps you burn fat!\r\n', 0, 4, 1),
(313, 38, 'This week you took your 5-Way every day! Your metabolism used those ingredients to rev up and burn unwanted fat!\r\n', 1, 4, 1),
(314, 38, 'This week you were diligent about taking your 5-Way - nice work! With vitamins, minerals and other metabolism-accelerating ingredients, 5-Way can be your ticket to accelerated fat loss!\r\n', 1, 4, 1),
(315, 38, 'You were really great about taking your 5-Way this week! You helped boost your metabolism and burn a ton of fat! Stick to it and do it again next week!\r\n', 1, 4, 1),
(316, 38, 'Nice work this month - you took your 5-Way consistently every day! Sometimes your metabolism just needs a little boost, which you gave it with the 5-Way. Next month make it a point to be as diligent as this month and your goals will soon be in sight!\r\n', 2, 4, 1),
(317, 38, 'This month you took your 5-Way regularly - perfect! You helped boost your metabolism with vitamins, minerals and other natural ingredients, accelerating fat loss, curbing cravings and moving you toward your goals more quickly!\r\n', 2, 4, 1),
(318, 38, 'You were great about taking your 5-Way this month! You helped keep your metabolism running in high gear while reducing cravings, helping break down foods, and increasing energy. Next month do the same exact thing - you''re on the right track!\r\n', 2, 4, 1),
(319, 1, 'Today you didn''t eat enough Protein in your meals. To stay in balance and burn plenty of fat, check the Portion Charts to estimate the amount of Protein you need, so your meals will be as effective as possible.\r\n', 0, 1, 0),
(320, 1, 'Looks like you didn''t eat enough Protein today. Remember that Protein provides you with energy as well as helping build muscle, your body''s fat-burning powerhouse. Review your Portion Charts and make it a priority to eat more Protein tomorrow.\r\n', 0, 1, 0),
(321, 1, 'At least one of your meals did not have enough Protein today - what happened? Remember that Protein is a vital componant to every Fat Loss Plate, helping keep you in Fat Burning Mode all day long.  Check your Portion Charts to see the correct amounts and get back on it tomorrow!\r\n', 0, 1, 0),
(322, 1, 'Protein provides the primary building blocks of lean muscle, your body''s fat-burning powerhouse. Getting the proper amount of it in each Fat Loss Plate is essential for success. This week, you ate too little Protein, so make it a priority for next week!\r\n', 1, 1, 0),
(323, 1, 'This week you ate too little Protein, which could have put you into Fat Storing Mode! But you can change all that next week - review your Food Journal then consult the Portion Charts and see where you can make improvements!\r\n', 1, 1, 0),
(324, 1, 'This week you came up short on Protein. Many people have this issue because they don''t know their options. Go back to the Portion Charts and note which foods are Proteins. Make a list of these foods to take with you to the grocery store and make it a point to increase your Protein intake next week.\r\n', 1, 1, 0),
(325, 1, 'This month you came up short in the Protein department. Here''s a tip for next month: buy your Protein (meat, chicken, fish, etc.) in bulk, then portion it out properly. Put each potion in a baggie or container and store them in the fridge or freezer. That way you''ll always have the right portions at the right time!\r\n', 2, 1, 0),
(326, 1, 'Keeping your Fat Loss Plates in balance is key to weight loss success on the Food Lovers System. This month you didn''t eat enough Protein, and could have slipped you into Fat Storing Mode.  Go through your Food Journal and review where you fell short, then make a plan of action to correct that next month!\r\n', 2, 1, 0),
(327, 1, 'Skimping on Protein can be detrimental to your fat loss plans.  Not only does it throw your Fat Loss Plates out of balance, it also cheats you out of amino acids, the elemental building blocks of lean muscle tissue - your body''s fat incinerator. Make it a point next month to eat the correct amount of Protein and keep your body in Fat Burning Mode.\r\n', 2, 1, 0),
(328, 39, 'Uh oh - at least one of your meals had no protein in them at all! What happened? Sometimes it can be hard to transport or plan for Protein in meals, but remember that Protein is a required component for every Fat Loss Plate. Review "How To Make A Fat Loss Plate" and take note of the Portion Charts for the proper sizes of your favorite Proteins.\r\n', 0, 1, 0),
(329, 39, 'Protein is a main component of every Fat Loss Plate, and at least one of your meals had none today! To stay in Fat Burning Mode, make sure your meals contain the correct amount of Protein tomorrow. For ideas and correct portion sizes, go back to the Portion Charts.\r\n', 0, 1, 0),
(330, 39, 'At least one of your meals today didn''t have Protein, which could send your body into Fat Storing Mode! But don''t worry - you can get right back on track tomorrow by reviewing the Portion Charts and adding a Protein to each of your meals.\r\n', 0, 1, 0),
(331, 39, 'Several of your meals this week didn''t contain Proteins. Remember that Protein provides you with amino acids, the building blocks of lean muscle, which as you remember is the key to your fat-burning powerhouse! Next week make it a priority to eat plenty of Protein with each meal to keep your program in track!\r\n', 1, 1, 0),
(332, 39, 'This week was too light in the Protein department, and several of your meals didn''t have any Protein at all! Remember that Protein is elemental to a properply balanced Fat Loss Plate, so make sure that next week you''re on top of things and getting all your nutrients on balance.\r\n', 1, 1, 0),
(333, 39, 'Your meals this week didnâ€™t contain enough Protein, which throws off the balance of your Fat Loss Plates. Remember: eating the right foods in the proper portions is the basis for the Food Lovers system. Next week make it a priority to eat enough Protein and stay in Fat Burning Mode!\r\n', 1, 1, 0),
(334, 39, 'Protein is an essential part of the Food Lovers system, and has to be included in your Fat Loss Plates in order for the plan to be successful. This month it seems like you had trouble balancing your portions, especially the Protein element. Review your Food Journal and refer back to the Portion Charts to see where you can make improvements next month. \r\n', 2, 1, 0),
(335, 39, 'Ok, so you already know what we''re going to say: you didn''t eat enough Protein this month. Yes, sometimes it can be hard to get the proper portion of each element, especially if you''re busy, but eating the right foods in the proper portions is key to Food Lovers success. Next month make it a priority to eat plenty of Protein, putting your Fat Loss Plates in balance and getting you back into Fat Burning Mode!\r\n', 2, 1, 0),
(336, 39, 'Eating enough Protein on a daily basis is essential for weight loss success. This month, you didn''t eat enough. Did it affect your results? Did you notice that you weren''t losing as much weight as you were expecting? Go back to the Portion Charts and review the Protein options and amounts. Make it your mission next month to do better and get back on track with the plan.\r\n', 2, 1, 0),
(337, 40, 'Seems like at least one of your meals had overly large Fast Carb portions. Remember: it''s important to keep your portions of all foods balanced, so your body stays in Fat Burning Mode.  Compare the Fast Carb portion charts with your Food Journal to see where you need to make adjustments. \r\n', 0, 1, 0),
(338, 40, 'Today you had too many Fast Carbs in your plan. Fast Carbs provide you with tons of energy, but eating too many of them can put you in Fat Storing Mode. Check the Portion Charts to estimate the right size of Fast Carb for you so you can stay in Fat Burning Mode all day long.\r\n', 0, 1, 0),
(339, 40, 'Careful! You''re overdoing it on Fast Carbs. Overeating Fast Carbs and other nutrients can cause those calories to be stored as fat, so watch your portion sizes to balance your Fat Loss Plate and stay in Fat Burning Mode. \r\n', 0, 1, 0),
(340, 40, 'Somtimes its difficult to get the hang of portion control, especially when it comes to Fast Carbs. But remember that the key to weight loss success with Food Lovers is a balanced Fat Loss Plate. This week you overate Fast Carbs, so look at the Portion Charts again and make a plan of attack for next week so you don''t overdo it with them again.\r\n', 1, 1, 0),
(341, 40, 'This week you overate your Fast Carbs in several meals, and threw those Fat Loss Plates out of balance. This means that you might have stalled out your fat-burning furnace and put yourself into Fat Storing Mode! Get back on track next week: review the Portion sizes for your favorite Fast Carbs and stick to them!\r\n', 1, 1, 0),
(342, 40, 'Seems you had trouble with Fast Carbs this week: many of your meals had portions that were too large. Sometimes eating more than a portion of Fast Carbs is tempting, but do your best to resist. Keep your Fat Loss Plates in balance for the best results.\r\n', 1, 1, 0),
(343, 40, 'This month you overate Fast Carbs. Often, this happens when people are not getting enough Fat or Protein, or when they are waiting too long between meals. Review the nutrient balance of your Fat Loss Plates this month to see if you''re skimping on other food groups, and investigate your meal timing to make sure you''re eating every 2-3 hours and staying in Fat Burning Mode.\r\n', 2, 1, 0),
(344, 40, 'Over the course of this month you ate too many Fast Carbs. Overating Fast Carbs is a common problem, since many of them come in snack-food form, and it''s easy to lose track of how much you ate. Next month, be diligent about your portion control. Parcel out any snack foods into baggies or containers so you know exactly how much you can eat in a given meal.\r\n', 2, 1, 0),
(345, 40, 'In order to stay on track with the Food Lovers plan, all of your meals have to be in balance; this month you ate too many Fast Carbs, which likely put you into Fat Storing Mode several times. But don''t worry - you can go back to Fat Burning Mode starting right now by tightening up the reins and bringing your portions back into balance. Make it your goal next month to do so!\r\n', 2, 1, 0),
(346, 41, 'Today several of your meals contained too much Fat. To keep the amount of Fat in each meal in balance with the other parts of your Fat Loss Plate, refer back to the Portion Charts to remind yourself of the correct amounts.\r\n', 0, 1, 0),
(347, 41, 'Uh oh.   You ate too much Fat today. It''s pretty easy to overeat Fat if you''re not paying attention so review the Portion Charts to estimate the right amount of Fat so all of the components of your Fat Loss Plate work together properly.\r\n', 0, 1, 0),
(348, 41, 'Fat is an essential element in a Fat Loss plate, but at least one of your meals today contained too much. To stayin  Fat Burning Mode go back to the Portion Charts to remind yourself of the correct sizes.\r\n', 0, 1, 0),
(349, 41, 'Today several of your meals contained too much Fat. To keep the amount of Fat in each meal in balance with the other parts of your Fat Loss Plate, refer back to the Portion Charts to remind yourself of the correct amounts.\r\n', 1, 1, 0),
(350, 41, 'Uh oh.   You ate too much Fat today. It''s pretty easy to overeat Fat if you''re not paying attention so review the Portion Charts to estimate the right amount of Fat so all of the components of your Fat Loss Plate work together properly.\r\n', 1, 1, 0),
(351, 41, 'Fat is an essential element in a Fat Loss plate, but at least one of your meals today contained too much. To stayin  Fat Burning Mode go back to the Portion Charts to remind yourself of the correct sizes.\r\n', 1, 1, 0),
(352, 41, 'This month you ate too much Fat. This is by far the easiest element to overeat because it can be so hidden. Be very aware next month about how much Fat your meals contain and especially remember that many Protein options contain a lot of dietary Fat. \r\n', 2, 1, 0),
(353, 41, 'Over the course of this month you had too much Fat in your diet. Overeating it can quickly send you into Fat Storing Mode. To regain balance next month and stay in Fat Burning Mode every day, look back at your Food Journal and the Portion Charts and compare them. Can you make any changes for next month? We bet you can!\r\n', 2, 1, 0),
(354, 41, 'Yes you need Fat in your diet, but this month you had too much of it. This may have limited your results, for eating too much Fat, or other food group, can alter the balance of your Fat Loss Plate and put you into Fat Storing Mode. Get back on track next month: make changes where you can and bring your Fat Loss Plates back into balance!\r\n', 2, 1, 0),
(355, 42, 'Today you had at least one meal with too much alcohol in it to be considered a Fat Loss Plate.  Remember: alcohol is considered a Fast Carb. Take that into consideration when building the rest of your Plate to stay in Fat Burning Mode.\r\n', 0, 1, 0),
(356, 42, 'Remember this: Alcohol is a Fast Carb! In at least one of your meals today, you had a little too much alcohol to stay in balance and remain in Fat Burning Mode.  Review your Portion Charts to remind yourself of the correct amount of alcohol for a Fat Loss Plate.\r\n', 0, 1, 0),
(357, 42, 'Oops! Looks like you had one too many cocktails today. Remember that alcohol is a Fast Carb with a specific portion size and that overdoing it can throw you out of Fat Burning Mode. Be more aware of your alcohol intake in the future and review the Portion Charts for help. \r\n', 0, 1, 0),
(358, 42, 'This week you overdid it a little with the alcohol. Sure, it happens - parties, celebrations, a romantic night out. But remember that too much of anything, including alcohol, can throw you out of balance with your plan. Next week, rein it in a bit to stay in Fat Burning Mode.\r\n', 1, 1, 0),
(359, 42, 'Heads up: this week your meals contained a little too much alcohol. Remember that to stay in Fat Burning Mode you have to have all your food groups in balance: Protein, Fast Carbs, Slow Carbs, and Fats. Alcohol is considered a Fast Carb, so remember that when planning your meals for next week so you don''t overdo it again. \r\n', 1, 1, 0),
(360, 42, 'Too much alcohol can throw off your fat-burning plan, and this week you overidid it a little. Many people forget that Alcohol is considered a Fast Carb in the Food Lovers plan, and end up over consuming Fast Carbs as a result. Review your Portion Charts for both alcohol and Fast Carbs to stay in balance next week.\r\n', 1, 1, 0),
(361, 42, 'This month you had a little too much alcohol, which could have affected your results. Because alcohol is considered a Fast Carb on the Food Lovers plan, it''s easy to overdo it if you''re not paying close attention. If you''re having a drink with dinner, cut back on or eliminate your Fast Carb for that meal to stay in balance. Pay a little more attention next month so you can lose as much weight as possible!\r\n', 2, 1, 0),
(362, 42, 'Over the course of this month, you had a few too many alcoholic beverages. Alcohol can slow digestion, which takes you out of Fat Burning Mode.  Refer back to your Portion charts and re-read the section on Alcohol so you''re better informed for next month.\r\n', 2, 1, 0),
(363, 42, 'Having too much of any one nutrient can throw off your Fat Loss plan. This month you had too much alcohol, which therefore increased your Fast Carb portions. To stay in balance and get back into Fat Burning Mode, review your journal pages and see where you can make adjustments next month!\r\n', 2, 1, 0);
