INSERT INTO `goal_plan` (`id`, `title`, `description`, `field_name`) VALUES
(1, 'Perfect Plates', 'If they received checkmark plates during the prescribed period. All plates for a given day need to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_plate'),
(2, 'Perfect Snacks', 'If they received checkmark snack plates during the prescribed period. All snacks for a given day need to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_snacks'),
(3, 'Perfect Schedule', 'If they did not receive an error regarding their eating schedule (ex. all meals/snacks within 2-3 hours). The schedule for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_schedule'),
(4, 'Eat a Fat Loss Breakfast within 30 minutes of waking up', 'Self-explanatory. This action for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_breakfastiming'),
(5, 'Stop eating in the hour before bed', 'Self-explanatory. This action for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_bedeat'),
(6, 'Take my nutritional supplements', 'Tracked in the middle/bottom left of the dashboard â€“ supplements are prescribed at the appropriate periods by the 21 day makeover. This action for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_nsup'),
(7, 'Avoid Alcohol', 'If the user did not consume a food item that was classified as an alcohol. This action for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'avoid_alcohol'),
(8, 'Perfect on Plan', 'The user needs to receive an A+ grade from the My Fat Loss Coach section in order to satisfy this requirement. This action for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_on_plan'),
(9, 'Perfect Sleep', 'The user needs to get at least 7 hours of sleep per night, but no more than 12 hours. This action for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_sleep'),
(10, 'Perfect Water', 'The user needs to drink at least 12 glasses of water per day. This action for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_water'),
(11, 'Perfect Resistance', 'The user confirms a resistance exercise on each day that they prescribe for themselves. This exercise can be on any duration over 15 minutes. This action for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_resistance'),
(12, 'Perfect Cardio', 'The user confirms a cardio exercise on each day that they prescribe for themselves. This exercise can be on any duration over 15 minutes. This action for a given day needs to be perfect in order to get a 100% for that day. If not, the user will get a 0% for that day.', 'perfect_cardio');
