INSERT INTO `msg_desc` (`id`, `mid`, `message`, `dayflag`, `priority`) VALUES
(1, 1, 'Since you slept for 9+ hours, your body may be stuck in Fat Storing Mode all day.  Stick to 7-8 hours to optimize your metabolism.', 0, 0),
(2, 1, 'Hey Sleepyhead! Remember that sleeping more than 9 hours can interfere with fat metabolism. Shoot for no more than 7-8 hours per night!', 0, 0),
(3, 1, 'You slept more than 9 hours last night, which is not ideal for fat burning today. Remember: 7-8 hours is all you really need!', 0, 0),
(4, 2, 'Perfect amount of sleep!  You got just enough rest last night to get your body off to a great start, so you can be in Fat Burning Mode all day long.', 0, 0),
(5, 2, 'You''re on track to be a fat-burning machine today! You got the perfect amount of sleep to allow your metabolism to do its thing!', 0, 0),
(6, 2, 'Last night you got just the right amount of sleep to optimize your fat burning metabolism. Good job!', 0, 0),
(7, 3, 'You didnâ€™t get quite enough rest last night, but you can still get into Fat Burning Mode today by eating proper Fat Loss Plates for all your meals and snacks.', 0, 0),
(8, 3, 'Last night you didnâ€™t get quite enough sleep. Today, focus on eating perfect Fat Loss Plates to help accelerate your metabolism and make up for it.', 0, 0),
(9, 3, 'Remember that sleeping 7-8 hours is ideal for fat burning â€“ last night you got only 5-7 hours! Try a little harder to get the rest you need each and every night.', 0, 0),
(10, 4, 'You got way too little sleep last night, and your metabolism will be struggling all day because of that.  Get at least 7 hours for optimum Fat Burning.', 0, 0),
(11, 4, 'You didnâ€™t get nearly enough sleep last night. Remember your body needs 7-8 hours of rest not only to repair and rebuild itself but also to burn fat and shed pounds!', 0, 0),
(12, 4, 'Last night you didnâ€™t get nearly enough sleep! Sleeping is an integral part of weight loss. Make up for that today by eating perfect Fat Loss Plates for all your meals and snacks.', 0, 0),
(13, 5, 'Your <meal name> was a perfect Fat Loss Plate. Congratulations!  Youâ€™re staying right in Fat Burning Mode.', 0, 0),
(14, 5, '<meal name> was a perfectly balanced Fat Loss Plate! This is the way to eat in order to lose all the weight you want!', 0, 0),
(15, 5, 'Your <meal name> was a well-planned Fat Loss Plate with all the ingredients for weight loss. Nice work!', 0, 0),
(16, 6, 'Your <meal name> was not a Fat Loss Plate, so you moved into Fat Storing Mode. Get back into Fat Burning Mode by eating a balanced Food Lovers Snack within 2-3 hours.', 0, 0),
(17, 6, 'Your <meal name> today was not a balanced Fat Loss Plate, which threw your plan off course. Get back into fat loss mode by eating a balanced Fat Loss Plate for your next meal or snack.', 0, 0),
(18, 6, '<meal name> was not a Fat Loss Plate, so you did not stay in Fat Burning Mode. Make your next meal or snack a Fat Loss Plate to get back on track.', 0, 0),
(19, 7, 'Your snack was perfect today. Keep it up! Youâ€™re staying within Fat Burning Mode.', 0, 0),
(20, 7, 'That snack was perfectly balanced with the right nutrients to keep your metabolism running and your body burning fat. Nice work!', 0, 0),
(21, 7, 'Your snack was the perfect size with the perfect balance of nutrients. Your body is still burning fat and shedding pounds and inches!', 0, 0),
(22, 8, 'Your snack was too large to be a proper Fat Loss Snack. Keep your snacks in the correct range for maximum fat burning.', 0, 0),
(23, 8, 'That snack was too large and moved you toward Fat Storing Mode. Get back on track with a balanced Fat Loss Plate for your next meal.', 0, 0),
(24, 8, 'Your snack was too large. Review your list of snacks and snack sizes and make adjustments for your next one to stay in Fat Burning Mode.', 0, 0),
(25, 9, 'Your snack was too small to be a proper Fat Loss Snack. Keep your snacks within the correct range for maximum Fat Burning.', 0, 0),
(26, 9, 'That snack was way too small. Your metabolism slows down without the proper nutrients, so eat a bigger snack next time to stay in Fat Burning Mode.', 0, 0),
(27, 9, 'Snacks need to be bigger than this to sustain your metabolism until your next meal. Make sure your between-meal snacks are large enough to fuel your body.', 0, 0),
(28, 10, 'Donâ€™t forget to take a good multi-vitamin each day to ensure your body gets the optimum amount of daily nutrients.', 0, 0),
(29, 10, 'Remember to take your multi-vitamin! Your body needs those nutrients for energy, food breakdown and a speedy metabolism!', 0, 0),
(30, 10, 'Take your multi-vitamin today. Give your body what it needs to fight fat and lose weight.', 0, 0),
(31, 11, 'Accelerate your fat loss with the 5-Way Fat Fighter. It contains a blend of five scientifically-studied herbs and nutrients that help accelerate your metabolism and aid in fat loss.', 0, 0),
(32, 11, 'Need a boost? Take your 5-Way! This fat-fighting blend of herbs and nutrients can give you energy and help accelerate fat loss!', 0, 0),
(33, 11, 'Accelerate your weight loss with the 5-Way Fat Fighter today! Use this blend of herbs and nutrients to give your body a boost in the fat burning direction!', 0, 0),
(34, 12, 'Donâ€™t forget the importance of exercise! Cardio and Resistance training not only keep you healthy, they also accelerate your metabolism.', 0, 0),
(35, 12, 'Youâ€™re not exercising very much. Exercise burns calories and builds muscle, both of which contribute to fat loss. Do your cardio and resistance training consistently for best results.', 0, 0),
(36, 12, 'You need to get more exercise. Remember: regular exercise gives you energy and contributes to weight loss!', 0, 0),
(37, 13, 'Itâ€™s time to weigh yourself! Hop on that scale and see where you are. Then enter that number on the Success Journal page so you can keep track of your progress.', 0, 0),
(38, 13, 'Itâ€™s time to get on the scale! Record your results in your Success Journal and see where you are. Then make a plan of action to move you toward your ultimate weight loss goal!', 0, 0),
(39, 13, 'Get on the scale today! Itâ€™s time to weigh yourself and see how youâ€™re progressing. Write your results in your Success Journal to keep track!', 0, 0),
(40, 14, 'Be sure to enter your measurements on the Success Journal page so you can watch how quickly your body changes as you drop fat!', 0, 0),
(41, 14, 'Remember: enter your measurements in your Success Journal! Compare them with your last entries â€“ how did you do?', 0, 0),
(42, 14, 'Enter your measurements in your Success Journal today and compare them to your last entries. Are you closer to your goals?', 0, 0),
(43, 15, 'Itâ€™s time to see how youâ€™re doing! Take your measurements and enter them on the Success Journal page so you can see how well youâ€™re doing.', 0, 0),
(44, 15, 'Time to measure up! Take your measurements again and enter them into your Success Journal. Compare them with your last entries to see how great youâ€™re doing!', 0, 0),
(45, 15, 'Time to take your measurements again! Enter your results into your Success Journal and compare them to your last entries to see where you are in your progress.', 0, 0),
(46, 16, 'Remember to include any oil, butter and fat you use in food preparation into your Eating Journal.', 0, 0),
(47, 16, 'The best Fat Loss Foods are on the outside aisles of the grocery store. Start there next time you shop.', 0, 0),
(48, 16, 'Look for fruits and veggies that are in-season. They cost less and taste MUCH better.', 0, 0),
(49, 16, 'When tempted with an excessive treat, remember: a minute on the lips, a lifetime on the hips!', 0, 0),
(50, 16, 'The more colorful your fruits and veggies, the more vitamins and nutrients they contain, for example green leafy lettuce versus iceberg.', 0, 0),
(51, 16, 'Remember: deprivation leads to bingeing! If you are craving a food, find a way to work it into your Fat Loss Plate or Snack. You CAN have all your favorite foods and still lose weight!', 0, 0),
(52, 16, 'Feeling uninspired by your meals lately? Go to our <members website> where members just like you share recipes and eating ideas!', 0, 0),
(53, 16, 'Need Snack ideas? Go to the Snack and Treat Guide â€“ with more than 1000 snacks to choose from, youâ€™ll always be in Fat Burning Mode!', 0, 0),
(54, 16, 'Planning meals is simple with the Million Meals Menu Planner. Make your family a Fat Loss dinner tonight!', 0, 0),
(55, 16, 'True or False: Pringles is a good Fat Loss snack.\r\nAnswer: True! When eaten in the proper portion, chips like Pringles can be part of your fat loss plan!\r\n', 0, 0),
(56, 16, 'Need a portable snack? Try an energy bar, such as a Luna or Balance Bar. These contain protein, carbohydrates and fats â€“ the perfect Fat Loss balance!', 0, 0),
(57, 16, 'Eyeballing your portions is key to dining out! Eat only what you need for a Fat Loss Plate and take the rest home for a nice Fat Loss meal later today or even tomorrow!', 0, 0),
(58, 16, 'Remember: Fat is high in calories so be mindful of your added Fats in each meal to stay in balance!', 0, 0),
(59, 16, 'When buying prepackaged snacks, read the ingredients carefully. Avoid items with saturated and trans fats, as well as hydrogenated or partially hydrogenated oils.', 0, 0),
(60, 16, 'On the road? Take your Eating Out Advisor with you! This will give you tips on ordering a Fat Loss Plate at restaurant chains across the country. You CAN stay on track and lose weight â€“ even away from home!', 0, 0),
(61, 16, 'Hungry between meals? Make sure youâ€™re eating enough at mealtime, are eating big enough snacks, and are eating every 2-3 hours.', 0, 0),
(62, 16, 'Protein is the basis for all Fat Loss Plates! Make sure youâ€™re getting a Protein with each meal to stay on track!', 0, 0),
(63, 16, 'Multiple studies show that dietary fiber helps you lose weight! Get your fiber by eating plenty of vegetables, whole grains, nuts and seeds.', 0, 0),
(64, 16, 'The Food Lovers system works for everyone â€“ even vegetarians! If youâ€™re on a special diet pay particular attention to your Fat Loss Plate balance for best results.', 0, 0),
(65, 16, 'Love breakfast? Have it for dinner! You can eat whatever you want when you want and still lose weight with Food Lovers!', 0, 0),
(66, 16, 'Remember: Leftovers make great lunches!', 0, 0),
(67, 16, 'Crockpots are a great way to concoct a Fat Loss Solo meal. Toss in some chicken, a few potatoes, a little olive oil and some veggies and set the heat on low. In the evening youâ€™ll have yourself a nice Fat Loss stew!', 0, 0),
(68, 16, 'Feeling hungry? Drink some water. A lot of times thirst is misinterpreted as hunger, so drink up first then reevaluate your hunger in 15-20 minutes.', 0, 0),
(69, 16, 'The words â€œon the sideâ€ should become part of your vocabulary, especially if you eat out a lot. Having sauces and condiments on the side allows you to control what you eat â€“ not the restaurant!', 0, 0),
(70, 16, 'Soup can be a great Fat Loss Solo! The best choices are ones with tomato, chicken or beef stock bases, such as chicken vegetable of beef barley.', 0, 0),
(71, 16, 'Holy huge portions! Most restaurants overdo it when it comes to portion size. Remember your visual cues to make the right decisions about your meal size.', 0, 0),
(72, 16, 'Use light or low-sodium soy sauce in Chinese and Japanese restaurants and cut your sodium by half!', 0, 0),
(73, 16, 'When eating fried foods, remember not to add a Fat to that meal to say in balance!', 0, 0),
(74, 16, 'What is your goal? Remind yourself frequently of your purpose to stay on track, especially during tough times.', 0, 0),
(75, 16, 'Remember to give yourself praise! Losing weight is not easy, so give yourself a compliment today! Write down three things you love about your physical self and post it on your mirror for motivation.', 0, 0),
(76, 16, 'Reward yourself for a job well done when you reach a goal!', 0, 0),
(77, 16, 'The farmerâ€™s market is a great place to find locally grown fresh fruits and veggies. They taste great and are affordable!', 0, 0),
(78, 16, 'Remember: Alcohol is considered a Fast Carb. When choosing an adult beverage with a meal, forego the Fast Carb in the Fat Loss Plate to stay in balance.', 0, 0),
(79, 16, 'Exercise can be anything active, from playing football with your kids to walking with your loved ones after dinner. Make the time to be active to help you get healthier and lose weight â€“ double benefits!', 0, 0),
(80, 16, 'Resistance training is key to accelerated weight loss! Lift weights to add muscle to your frame and boost your metabolism!', 0, 0),
(81, 16, 'Journaling is key to successful weight loss. Enter anything and everything you can into your journal to stay on track!', 0, 0),
(82, 16, 'Working out with a buddy can be a great way to get in your exercise. You motivate one another and make each other accountable, so pair up with a partner today!', 0, 0),
(83, 16, 'Are you stiff and sore? Exercise can help, even with conditions such as arthritis and fibromyalgia. Start slowly, and build up your strength and endurance to reduce pain and improve health.', 0, 0),
(84, 16, 'Anyone at any age can lose weight and look great! Whether youâ€™re 25 or 85, you can do it with Food Lovers!', 0, 0),
(85, 16, 'Itâ€™s never too late to start exercising! Anyone at any age can lift weights and do cardio to improve health and lose weight!', 0, 0),
(86, 16, 'Bored with water? Add a little cranberry juice to it, or some lemons or limes to change things up. Also try sparkling water, or flavored-infused Perrier as a calorie-free alternative.', 0, 0),
(87, 16, 'Instead of salt, try Mrs. Dash or other salt-free seasonings. Fresh and dried herbs, pepper blends and fresh spices are great ways to season without salt.', 0, 0),
(88, 16, 'Stop mindless eating! Donâ€™t zone out in front of the TV and simply eat because something is in front of you. Stick to your Food Lovers meal plan and youâ€™ll shed weight in no time!', 0, 0);
